[{"location":"democards/problems/id/576.out-of-boundary-paths/#.out-of-boundary-paths","page":"576.out of boundary paths","title":"576.out of boundary paths","text":"","category":"section"},{"location":"democards/problems/id/576.out-of-boundary-paths/","page":"576.out of boundary paths","title":"576.out of boundary paths","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/576.out-of-boundary-paths/","page":"576.out of boundary paths","title":"576.out of boundary paths","text":"\"\"\"\n@lc app=leetcode id=576 lang=python3\n\n[576] Out of Boundary Paths\n\nhttps://leetcode.com/problems/out-of-boundary-paths/description/\n\nalgorithms\nMedium (33.50%)\nLikes:    619\nDislikes: 139\nTotal Accepted:    31K\nTotal Submissions: 87.5K\nTestcase Example:  '2\\n2\\n2\\n0\\n0'\n\nThere is an m by n grid with a ball. Given the start coordinate (i,j) of the\nball, you can move the ball to adjacent cell or cross the grid boundary in\nfour directions (up, down, left, right). However, you can at most move N\ntimes. Find out the number of paths to move the ball out of grid boundary.\nThe answer may be very large, return it after mod 10^9 + 7.\n\n\n\nExample 1:\n\n\nInput: m = 2, n = 2, N = 2, i = 0, j = 0\nOutput: 6\nExplanation:\n\n\n\nExample 2:\n\n\nInput: m = 1, n = 3, N = 3, i = 0, j = 1\nOutput: 12\nExplanation:\n\n\n\n\n\nNote:\n\n\nOnce you move the ball out of boundary, you cannot move it back.\nThe length and height of the grid is in range [1,50].\nN is in range [0,50].\n\n\n\n\n@lc code=start\n\"\"\"\nfunction find_paths(m, n, N, i, j)\n    dp = zeros(Int, m, n)\n\n    for _ in 1:N\n        t = copy(dp)\n        inds = CartesianIndices(t)\n        for x in inds\n            v = 0\n            for dir in ((0, -1), (0, 1), (1, 0), (-1, 0))\n                p = x + CartesianIndex(dir)\n                v += p ∈ inds ? t[p] : 1\n            end\n            dp[x] = v\n        end\n    end\n    return dp[i, j] % (10^9 + 7)\nend","category":"page"},{"location":"democards/problems/id/576.out-of-boundary-paths/","page":"576.out of boundary paths","title":"576.out of boundary paths","text":"","category":"page"},{"location":"democards/problems/id/576.out-of-boundary-paths/","page":"576.out of boundary paths","title":"576.out of boundary paths","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/9.palindrome-number/#.palindrome-number","page":"9.palindrome number","title":"9.palindrome number","text":"","category":"section"},{"location":"democards/problems/id/9.palindrome-number/","page":"9.palindrome number","title":"9.palindrome number","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/9.palindrome-number/","page":"9.palindrome number","title":"9.palindrome number","text":"\"\"\"\n@lc app=leetcode id=9 lang=python3\n\n[9] Palindrome Number\n\nhttps://leetcode.com/problems/palindrome-number/description/\n\nalgorithms\nEasy (46.22%)\nLikes:    1841\nDislikes: 1457\nTotal Accepted:    771.5K\nTotal Submissions: 1.7M\nTestcase Example:  '121'\n\nDetermine whether an integer is a palindrome. An integer is a palindrome when\nit reads the same backward as forward.\n\nExample 1:\n\n\nInput: 121\nOutput: true\n\n\nExample 2:\n\n\nInput: -121\nOutput: false\nExplanation: From left to right, it reads -121. From right to left, it\nbecomes 121-. Therefore it is not a palindrome.\n\n\nExample 3:\n\n\nInput: 10\nOutput: false\nExplanation: Reads 01 from right to left. Therefore it is not a palindrome.\n\n\nFollow up:\n\nCoud you solve it without converting the integer to a string?\n\n\n\n@lc code=start\n\"\"\"\nfunction is_palindrome(x::Int)::Bool\n    if x < 0\n        false\n    else\n        y = x\n        y_reverse = 0\n        while y > 0\n            y, n = divrem(y, 10)\n            y_reverse = y_reverse * 10 + n\n        end\n        x == y_reverse\n    end\nend","category":"page"},{"location":"democards/problems/id/9.palindrome-number/","page":"9.palindrome number","title":"9.palindrome number","text":"","category":"page"},{"location":"democards/problems/id/9.palindrome-number/","page":"9.palindrome number","title":"9.palindrome number","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/90.subsets-ii/#.subsets-ii","page":"90.subsets ii","title":"90.subsets ii","text":"","category":"section"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"\"\"\"\n@lc app=leetcode id=90 lang=python3\n\n[90] Subsets II\n\nhttps://leetcode.com/problems/subsets-ii/description/\n\nalgorithms\nMedium (44.83%)\nLikes:    1788\nDislikes: 79\nTotal Accepted:    290.9K\nTotal Submissions: 614.9K\nTestcase Example:  '[1,2,2]'\n\nGiven a collection of integers that might contain duplicates, nums, return\nall possible subsets (the power set).\n\nNote: The solution set must not contain duplicate subsets.\n\nExample:\n\n\nInput: [1,2,2]\nOutput:\n[\n⁠ [2],\n⁠ [1],\n⁠ [1,2,2],\n⁠ [2,2],\n⁠ [1,2],\n⁠ []\n]\n\n\n\n\n@lc code=start\n\"\"\"\nfunction subsets_with_dup(nums::Vector{Int})::Vector{Vector{Int}}\n    sort!(nums)\n    res = Vector{Int}[Int[]]\n\n    n = 0\n    for (i, x) in enumerate(nums)\n        if i == 1\n            n = 1\n        elseif nums[i] != nums[i - 1]\n            n = length(res)","category":"page"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"n is used to record how many sets to skip in case nums[i+1] == nums[i]","category":"page"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"        end\n\n        if n == length(res)\n            for j in 1:n\n                push!(res, [res[j]..., nums[i]])\n            end\n        else\n            for j in (length(res) - n + 1):length(res)\n                push!(res, [res[j]..., nums[i]])\n            end\n        end\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"","category":"page"},{"location":"democards/problems/id/90.subsets-ii/","page":"90.subsets ii","title":"90.subsets ii","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/#.minimum-number-of-arrows-to-burst-balloons","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"","category":"section"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"@lc app=leetcode id=452 lang=julia","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"[452] Minimum Number of Arrows to Burst Balloons","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"\"\"\"\nThere are some spherical balloons spread in two-dimensional space. For each balloon, provided input is the start and end coordinates of the horizontal diameter. Since it's horizontal, y-coordinates don't matter, and hence the x-coordinates of start and end of the diameter suffice. The start is always smaller than the end.\n\nAn arrow can be shot up exactly vertically from different points along the x-axis. A balloon with xstart and xend bursts by an arrow shot at x if xstart ≤ x ≤ xend. There is no limit to the number of arrows that can be shot. An arrow once shot keeps traveling up infinitely.\n\nGiven an array points where points[i] = [xstart, xend], return the minimum number of arrows that must be shot to burst all balloons.\n\n\n\nExample 1:\n\nInput: points = [[10,16],[2,8],[1,6],[7,12]]\nOutput: 2\nExplanation: One way is to shoot one arrow for example at x = 6 (bursting the balloons [2,8] and [1,6]) and another arrow at x = 11 (bursting the other two balloons).\nExample 2:\n\nInput: points = [[1,2],[3,4],[5,6],[7,8]]\nOutput: 4\nExample 3:\n\nInput: points = [[1,2],[2,3],[3,4],[4,5]]\nOutput: 2\nExample 4:\n\nInput: points = [[1,2]]\nOutput: 1\nExample 5:\n\nInput: points = [[2,3],[2,3]]\nOutput: 1\n\n\nConstraints:\n\n0 <= points.length <= 104\npoints[i].length == 2\n-231 <= xstart < xend <= 231 - 1\n\n\"\"\"","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"function find_min_arrow_shots(points::Vector{Vector{Int}})::Int\n    if isempty(points)\n        return 0\n    end\n    sort!(points; by=x -> x[2])\n    ed, res = points[1][2], 1\n    for point in points\n        if point[1] > ed\n            res += 1\n            ed = point[2]\n        end\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"","category":"page"},{"location":"democards/problems/id/452.minimum-number-of-arrows-to-burst-balloons/","page":"452.minimum number of arrows to burst balloons","title":"452.minimum number of arrows to burst balloons","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/8.string-to-integer-atoi/#.string-to-integer-atoi","page":"8.string to integer atoi","title":"8.string to integer atoi","text":"","category":"section"},{"location":"democards/problems/id/8.string-to-integer-atoi/","page":"8.string to integer atoi","title":"8.string to integer atoi","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/8.string-to-integer-atoi/","page":"8.string to integer atoi","title":"8.string to integer atoi","text":"\"\"\"\n@lc app=leetcode id=8 lang=python3\n\n[8] String to Integer (atoi)\n\nhttps://leetcode.com/problems/string-to-integer-atoi/description/\n\nalgorithms\nMedium (14.95%)\nLikes:    1706\nDislikes: 9812\nTotal Accepted:    598.6K\nTotal Submissions: 3.9M\nTestcase Example:  '\"42\"'\n\nImplement atoi which converts a string to an integer.\n\nThe function first discards as many whitespace characters as necessary until\nthe first non-whitespace character is found. Then, starting from this\ncharacter, takes an optional initial plus or minus sign followed by as many\nnumerical digits as possible, and interprets them as a numerical value.\n\nThe string can contain additional characters after those that form the\nintegral number, which are ignored and have no effect on the behavior of this\nfunction.\n\nIf the first sequence of non-whitespace characters in str is not a valid\nintegral number, or if no such sequence exists because either str is empty or\nit contains only whitespace characters, no conversion is performed.\n\nIf no valid conversion could be performed, a zero value is returned.\n\nNote:\n\n\nOnly the space character ' ' is considered as whitespace character.\nAssume we are dealing with an environment which could only store integers\nwithin the 32-bit signed integer range: [−2^31,  2^31 − 1]. If the numerical\nvalue is out of the range of representable values, INT_MAX (2^31 − 1) or\nINT_MIN (−2^31) is returned.\n\n\nExample 1:\n\n\nInput: \"42\"\nOutput: 42\n\n\nExample 2:\n\n\nInput: \"   -42\"\nOutput: -42\nExplanation: The first non-whitespace character is '-', which is the minus\nsign.\nThen take as many numerical digits as possible, which gets 42.\n\n\nExample 3:\n\n\nInput: \"4193 with words\"\nOutput: 4193\nExplanation: Conversion stops at digit '3' as the next character is not a\nnumerical digit.\n\n\nExample 4:\n\n\nInput: \"words and 987\"\nOutput: 0\nExplanation: The first non-whitespace character is 'w', which is not a\nnumerical\ndigit or a +/- sign. Therefore no valid conversion could be performed.\n\nExample 5:\n\n\nInput: \"-91283472332\"\nOutput: -2147483648\nExplanation: The number \"-91283472332\" is out of the range of a 32-bit signed\ninteger.\nThefore INT_MIN (−2^31) is returned.\n\n\n\n@lc code=start\n\"\"\"\nfunction my_atoi(s::String)::Int\n    s = lstrip(s)\n    if length(s) == 0\n        0\n    else\n        try\n            m = match(r\"^[\\-\\+]?[0-9]+\", s)\n            if isnothing(m)\n                0\n            else\n                parse(Int32, m.match)\n            end\n        catch\n            if s[1] == '-'\n                typemin(Int32)\n            else\n                typemax(Int32)\n            end\n        end\n    end\nend","category":"page"},{"location":"democards/problems/id/8.string-to-integer-atoi/","page":"8.string to integer atoi","title":"8.string to integer atoi","text":"","category":"page"},{"location":"democards/problems/id/8.string-to-integer-atoi/","page":"8.string to integer atoi","title":"8.string to integer atoi","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/901.online-stock-span/#.online-stock-span","page":"901.online stock span","title":"901.online stock span","text":"","category":"section"},{"location":"democards/problems/id/901.online-stock-span/","page":"901.online stock span","title":"901.online stock span","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/901.online-stock-span/","page":"901.online stock span","title":"901.online stock span","text":"\"\"\"\n@lc app=leetcode id=901 lang=python3\n\n[901] Online Stock Span\n\nhttps://leetcode.com/problems/online-stock-span/description/\n\nalgorithms\nMedium (52.56%)\nLikes:    994\nDislikes: 140\nTotal Accepted:    72.9K\nTotal Submissions: 120.9K\nTestcase Example:  '[\"StockSpanner\",\"next\",\"next\",\"next\",\"next\",\"next\",\"next\",\"next\"]\\n' + '[[],[100],[80],[60],[70],[60],[75],[85]]'\n\nWrite a class StockSpanner which collects daily price quotes for some stock,\nand returns the span of that stock's price for the current day.\n\nThe span of the stock's price today is defined as the maximum number of\nconsecutive days (starting from today and going backwards) for which the\nprice of the stock was less than or equal to today's price.\n\nFor example, if the price of a stock over the next 7 days were [100, 80, 60,\n70, 60, 75, 85], then the stock spans would be [1, 1, 1, 2, 1, 4, 6].\n\n\n\n\nExample 1:\n\n\nInput: [\"StockSpanner\",\"next\",\"next\",\"next\",\"next\",\"next\",\"next\",\"next\"],\n[[],[100],[80],[60],[70],[60],[75],[85]]\nOutput: [null,1,1,1,2,1,4,6]\nExplanation:\nFirst, S = StockSpanner() is initialized.  Then:\nS.next(100) is called and returns 1,\nS.next(80) is called and returns 1,\nS.next(60) is called and returns 1,\nS.next(70) is called and returns 2,\nS.next(60) is called and returns 1,\nS.next(75) is called and returns 4,\nS.next(85) is called and returns 6.\n\nNote that (for example) S.next(75) returned 4, because the last 4 prices\n(including today's price of 75) were less than or equal to today's\nprice.\n\n\n\n\nNote:\n\n\nCalls to StockSpanner.next(int price) will have 1 <= price <= 10^5.\nThere will be at most 10000 calls to StockSpanner.next per test case.\nThere will be at most 150000 calls to StockSpanner.next across all test\ncases.\nThe total time limit for this problem has been reduced by 75% for C++, and\n50% for all other languages.\n\n\n\n\n\n@lc code=start\n\"\"\"\nBase.@kwdef struct StockSpanner\n    history::Vector{Pair{Int,Int}} = []\nend\n\nfunction next!(s::StockSpanner, price::Int)\n    span = 1\n    while !isempty(s.history) && s.history[end][1] <= price\n        span += s.history[end][2]\n        pop!(s.history)\n    end\n    push!(s.history, price => span)\n    return span\nend","category":"page"},{"location":"democards/problems/id/901.online-stock-span/","page":"901.online stock span","title":"901.online stock span","text":"","category":"page"},{"location":"democards/problems/id/901.online-stock-span/","page":"901.online stock span","title":"901.online stock span","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1.two-sum/#.two-sum","page":"1.two sum","title":"1.two sum","text":"","category":"section"},{"location":"democards/problems/id/1.two-sum/","page":"1.two sum","title":"1.two sum","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1.two-sum/","page":"1.two sum","title":"1.two sum","text":"\"\"\"\n@lc app=leetcode id=1 lang=python\n\n[1] Two Sum\n\nhttps://leetcode.com/problems/two-sum/description/\n\nalgorithms\nEasy (44.95%)\nTotal Accepted:    2.5M\nTotal Submissions: 5.5M\nTestcase Example:  '[2,7,11,15]\\n9'\n\n<p>Given an array of integers, return <strong>indices</strong> of the two\nnumbers such that they add up to a specific target.</p>\n\n<p>You may assume that each input would have\n<strong><em>exactly</em></strong> one solution, and you may not use the\n<em>same</em> element twice.</p>\n\n<p><strong>Example:</strong></p>\n\n<pre>\nGiven nums = [2, 7, 11, 15], target = 9,\n\nBecause nums[<strong>0</strong>] + nums[<strong>1</strong>] = 2 + 7 = 9,\nreturn [<strong>0</strong>, <strong>1</strong>].\n</pre>\n\n\"\"\"\nfunction two_sum(nums::Vector{Int}, target::Int)::Union{Nothing,Tuple{Int,Int}}\n    seen = Dict{Int,Int}()\n    for (i, n) in enumerate(nums)\n        m = target - n\n        if haskey(seen, m)\n            return seen[m], i\n        else\n            seen[n] = i\n        end\n    end\nend","category":"page"},{"location":"democards/problems/id/1.two-sum/","page":"1.two sum","title":"1.two sum","text":"","category":"page"},{"location":"democards/problems/id/1.two-sum/","page":"1.two sum","title":"1.two sum","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/#.add-two-numbers","page":"2.add two numbers","title":"2.add two numbers","text":"","category":"section"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"\"\"\"","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"[2] Add Two Numbers","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"https://leetcode.com/problems/add-two-numbers/description/\n\n- algorithms\n- Medium (32.52%)\n- Likes:    8986\n- Dislikes: 2266\n- Total Accepted:    1.5M\n- Total Submissions: 4.4M\n- Testcase Example:  '[2,4,3]\\n[5,6,4]'\n\nYou are given two non-empty linked lists representing two non-negative\nintegers. The digits are stored in reverse order and each of their nodes\ncontain a single digit. Add the two numbers and return it as a linked list.\n\nYou may assume the two numbers do not contain any leading zero, except the\nnumber 0 itself.\n\nExample:\n\n\nInput: (2 -> 4 -> 3) + (5 -> 6 -> 4)\nOutput: 7 -> 0 -> 8\nExplanation: 342 + 465 = 807.\n\"\"\"\nfunction add_two_numbers(l1::ListNode, l2::ListNode)::ListNode\n    carry = 0\n    fake_head = cur = ListNode()\n\n    while !isnothing(l1) || !isnothing(l2) || !iszero(carry)\n        v1, v2 = 0, 0\n\n        if !isnothing(l1)\n            v1 = val(l1)\n            l1 = next(l1)\n        end\n\n        if !isnothing(l2)\n            v2 = val(l2)\n            l2 = next(l2)\n        end\n\n        carry, v = divrem(v1 + v2 + carry, 10)\n        next!(cur, ListNode(v))\n        cur = next(cur)\n    end\n    return next(fake_head)\nend","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"","category":"page"},{"location":"democards/problems/id/2.add-two-numbers/","page":"2.add two numbers","title":"2.add two numbers","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/679.24-game/#.24-game","page":"679.24 game","title":"679.24 game","text":"","category":"section"},{"location":"democards/problems/id/679.24-game/","page":"679.24 game","title":"679.24 game","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/679.24-game/","page":"679.24 game","title":"679.24 game","text":"\"\"\"\n@lc app=leetcode id=679 lang=python3\n\n[679] 24 Game\n\nhttps://leetcode.com/problems/24-game/description/\n\nalgorithms\nHard (44.65%)\nLikes:    750\nDislikes: 151\nTotal Accepted:    42K\nTotal Submissions: 90.2K\nTestcase Example:  '[4,1,8,7]'\n\n\nYou have 4 cards each containing a number from 1 to 9.  You need to judge\nwhether they could operated through *, /, +, -, (, ) to get the value of\n24.\n\n\nExample 1:\n\nInput: [4, 1, 8, 7]\nOutput: True\nExplanation: (8-4) * (7-1) = 24\n\n\n\nExample 2:\n\nInput: [1, 2, 1, 2]\nOutput: False\n\n\n\nNote:\n\nThe division operator / represents real division, not integer division.  For\nexample, 4 / (1 - 2/3) = 12.\nEvery operation done is between two numbers.  In particular, we cannot use -\nas a unary operator.  For example, with [1, 1, 1, 1] as input, the expression\n-1 - 1 - 1 - 1 is not allowed.\nYou cannot concatenate numbers together.  For example, if the input is [1, 2,\n1, 2], we cannot write this as 12 + 12.\n\n\n\n\n\n@lc code=start\n\"\"\"\nfunction judgePoint24(nums::Vector)::Bool\n    n = length(nums)\n    if n == 1\n        return nums[1] == 24\n    else\n        for i in 1:n\n            for j in 1:n\n                if j != i\n                    rest = [nums[k] for k in 1:n if k != i && k != j]\n                    if judgePoint24([rest..., nums[i] + nums[j]]) ||\n                       judgePoint24([rest..., nums[i] - nums[j]]) ||\n                       judgePoint24([rest..., nums[j] - nums[i]]) ||\n                       judgePoint24([rest..., nums[i] * nums[j]]) ||\n                       (!iszero(nums[j]) && judgePoint24([rest..., nums[i]//nums[j]])) ||\n                       (!iszero(nums[i]) && judgePoint24([rest..., nums[j]//nums[i]]))\n                        return true\n                    end\n                end\n            end\n        end\n        false\n    end\nend","category":"page"},{"location":"democards/problems/id/679.24-game/","page":"679.24 game","title":"679.24 game","text":"","category":"page"},{"location":"democards/problems/id/679.24-game/","page":"679.24 game","title":"679.24 game","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/#.regular-expression-matching","page":"10.regular expression matching","title":"10.regular expression matching","text":"","category":"section"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"\"\"\"\n@lc app=leetcode id=10 lang=python3\n\n[10] Regular Expression Matching\n\nhttps://leetcode.com/problems/regular-expression-matching/description/\n\nalgorithms\nHard (26.06%)\nLikes:    4558\nDislikes: 731\nTotal Accepted:    454.2K\nTotal Submissions: 1.7M\nTestcase Example:  '\"aa\"\\n\"a\"'\n\nGiven an input string (s) and a pattern (p), implement regular expression\nmatching with support for '.' and '*'.\n\n\n'.' Matches any single character.\n'*' Matches zero or more of the preceding element.\n\n\nThe matching should cover the entire input string (not partial).\n\nNote:\n\n\ns could be empty and contains only lowercase letters a-z.\np could be empty and contains only lowercase letters a-z, and characters like\n. or *.\n\n\nExample 1:\n\n\nInput:\ns = \"aa\"\np = \"a\"\nOutput: false\nExplanation: \"a\" does not match the entire string \"aa\".\n\n\nExample 2:\n\n\nInput:\ns = \"aa\"\np = \"a*\"\nOutput: true\nExplanation: '*' means zero or more of the preceding element, 'a'. Therefore,\nby repeating 'a' once, it becomes \"aa\".\n\n\nExample 3:\n\n\nInput:\ns = \"ab\"\np = \".*\"\nOutput: true\nExplanation: \".*\" means \"zero or more (*) of any character (.)\".\n\n\nExample 4:\n\n\nInput:\ns = \"aab\"\np = \"c*a*b\"\nOutput: true\nExplanation: c can be repeated 0 times, a can be repeated 1 time. Therefore,\nit matches \"aab\".\n\n\nExample 5:\n\n\nInput:\ns = \"mississippi\"\np = \"mis*is*p*.\"\nOutput: false\n\n\n\n\n@lc code=start\n\"\"\"\nfunction is_match(s::AbstractString, p::AbstractString)::Bool\n    if isempty(p)\n        isempty(s)\n    elseif length(p) >= 2 && p[2] == '*'\n        if !isempty(s) && (s[1] == p[1] || p[1] == '.')","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"case 1: * means 1 or more of previous char, then the first char of s and p must match.","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"            is_match(SubString(s, 2), p)\n        else","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"case 2: * means zero of previous char, ignore it and match the rest","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"            is_match(s, SubString(p, 3))\n        end\n    else\n        if isempty(s)\n            false  # length mismatch\n        elseif (s[1] == p[1] || p[1] == '.')\n            is_match(SubString(s, 2), SubString(p, 2))\n        else\n            false  # first char mismatch\n        end\n    end\nend","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"","category":"page"},{"location":"democards/problems/id/10.regular-expression-matching/","page":"10.regular expression matching","title":"10.regular expression matching","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/#.furthest-building-you-can-reach","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"","category":"section"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"@lc app=leetcode id=1642 lang=python3","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"[1642] Furthest Building You Can Reach","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"\"\"\"\nYou are given an integer array heights representing the heights of buildings, some bricks, and some ladders.\n\nYou start your journey from building 0 and move to the next building by possibly using bricks or ladders.\n\nWhile moving from building i to building i+1 (0-indexed),\n\nIf the current building's height is greater than or equal to the next building's height, you do not need a ladder or bricks.\nIf the current building's height is less than the next building's height, you can either use one ladder or (h[i+1] - h[i]) bricks.\nReturn the furthest building index (0-indexed) you can reach if you use the given ladders and bricks optimally.\n\n\n\nExample 1:\n\n\nInput: heights = [4,2,7,6,9,14,12], bricks = 5, ladders = 1\nOutput: 4\nExplanation: Starting at building 0, you can follow these steps:\n- Go to building 1 without using ladders nor bricks since 4 >= 2.\n- Go to building 2 using 5 bricks. You must use either bricks or ladders because 2 < 7.\n- Go to building 3 without using ladders nor bricks since 7 >= 6.\n- Go to building 4 using your only ladder. You must use either bricks or ladders because 6 < 9.\nIt is impossible to go beyond building 4 because you do not have any more bricks or ladders.\nExample 2:\n\nInput: heights = [4,12,2,7,3,18,20,3,19], bricks = 10, ladders = 2\nOutput: 7\nExample 3:\n\nInput: heights = [14,3,19,3], bricks = 17, ladders = 0\nOutput: 3\n\n\nConstraints:\n\n1 <= heights.length <= 105\n1 <= heights[i] <= 106\n0 <= bricks <= 109\n0 <= ladders <= heights.length\n\"\"\"","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"using DataStructures\nfunction furthest_building(heights::Vector{Int}, bricks::Int, ladders::Int)\n    q = Int[]\n    for i in 1:(length(heights) - 1)\n        diff = heights[i + 1] - heights[i]\n        if diff > 0\n            if diff > bricks && ladders == 0\n                return i - 1\n            end\n            if bricks >= diff\n                heappush!(q, diff)\n                bricks -= diff\n            else\n                if !isempty(q) && q[1] > diff\n                    bricks += heappop!(q) - diff\n                    heappush!(q, diff)\n                end\n                ladders -= 1\n            end\n        end\n    end\n    return length(heights) - 1\nend","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"","category":"page"},{"location":"democards/problems/id/1642.furthest-building-you-can-reach/","page":"1642.furthest building you can reach","title":"1642.furthest building you can reach","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/#.minimum-operations-to-reduce-x-to-zero","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"","category":"section"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"@lc app=leetcode id=1658 lang=julia","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"[134] Minimum Operations to Reduce X to Zero","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"\"\"\"\nYou are given an integer array nums and an integer x. In one operation, you can either remove the leftmost or the rightmost element from the array nums and subtract its value from x. Note that this modifies the array for future operations.\n\nReturn the minimum number of operations to reduce x to exactly 0 if it's possible, otherwise, return -1.\n\n\n\nExample 1:\n\nInput: nums = [1,1,4,2,3], x = 5\nOutput: 2\nExplanation: The optimal solution is to remove the last two elements to reduce x to zero.\nExample 2:\n\nInput: nums = [5,6,7,8,9], x = 4\nOutput: -1\nExample 3:\n\nInput: nums = [3,2,20,1,1,3], x = 10\nOutput: 5\nExplanation: The optimal solution is to remove the last three elements and the first two elements (5 operations in total) to reduce x to zero.\n\n\nConstraints:\n\n1 <= nums.length <= 105\n1 <= nums[i] <= 104\n1 <= x <= 109\n\"\"\"\n\nfunction min_operations(nums::Vector{Int}, x::Int)\n    rnums = reverse(nums)\n    if nums[1] > x && rnums[1] > x\n        return -1\n    end\n    len = length(nums)\n    rlm, llm, res = len, len, len\n    for i in 1:(len - 1)\n        if ((nums[i + 1] += nums[i]) > x)\n            rlm = i\n            break\n        end\n    end\n    if rm == len\n        if nums[end] < x\n            return -1\n        else\n            return len\n        end\n    end\n    for i in 1:(len - 1)\n        if ((rnums[i + 1] += rnums[i]) > x)\n            llm = i\n            break\n        end\n    end\n    i, j = 1, llm\n    while i <= rlm && j > 0\n        if nums[i] == x\n            res = min(i, res)\n            i += 1\n        elseif rnums[j] == x\n            res = min(j, res)\n            j -= 1\n        else\n            sm = nums[i] + rnums[j]","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"println(i,\" \", j,\" \", sm)","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"            if sm == x\n                res = min(i + j, res)\n                i += 1\n                j -= 1\n            elseif sm > x\n                j -= 1\n            else\n                i += 1\n            end\n        end\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"","category":"page"},{"location":"democards/problems/id/1658.minimum-operations-to-reduce-x-to-zero/","page":"1658.minimum operations to reduce x to zero","title":"1658.minimum operations to reduce x to zero","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1128.number-of-equivalent-domino-pairs/#.number-of-equivalent-domino-pairs","page":"1128.number of equivalent domino pairs","title":"1128.number of equivalent domino pairs","text":"","category":"section"},{"location":"democards/problems/id/1128.number-of-equivalent-domino-pairs/","page":"1128.number of equivalent domino pairs","title":"1128.number of equivalent domino pairs","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1128.number-of-equivalent-domino-pairs/","page":"1128.number of equivalent domino pairs","title":"1128.number of equivalent domino pairs","text":"\"\"\"\n@lc app=leetcode id=1128 lang=python3\n\n[1128] Number of Equivalent Domino Pairs\n\nhttps://leetcode.com/problems/number-of-equivalent-domino-pairs/description/\n\nalgorithms\nEasy (46.56%)\nLikes:    216\nDislikes: 123\nTotal Accepted:    25.2K\nTotal Submissions: 53.3K\nTestcase Example:  '[[1,2],[2,1],[3,4],[5,6]]'\n\nGiven a list of dominoes, dominoes[i] = [a, b] is equivalent to dominoes[j] =\n[c, d] if and only if either (a==c and b==d), or (a==d and b==c) - that is,\none domino can be rotated to be equal to another domino.\n\nReturn the number of pairs (i, j) for which 0 <= i < j < dominoes.length, and\ndominoes[i] is equivalent to dominoes[j].\n\n\nExample 1:\nInput: dominoes = [[1,2],[2,1],[3,4],[5,6]]\nOutput: 1\n\n\nConstraints:\n\n\n1 <= dominoes.length <= 40000\n1 <= dominoes[i][j] <= 9\n\n\n\n@lc code=start\n\"\"\"\nfunction num_equiv_domino_pairs(dominoes::Vector{Tuple{Int,Int}})::Int\n    counts = Dict{Tuple{Int,Int},Int}()\n    n = 0\n    for (k, v) in dominoes\n        p = minmax(k, v)\n        if haskey(counts, p)\n            n += counts[p]\n            counts[p] += 1\n        else\n            counts[p] = 1\n        end\n    end\n    return n\nend","category":"page"},{"location":"democards/problems/id/1128.number-of-equivalent-domino-pairs/","page":"1128.number of equivalent domino pairs","title":"1128.number of equivalent domino pairs","text":"","category":"page"},{"location":"democards/problems/id/1128.number-of-equivalent-domino-pairs/","page":"1128.number of equivalent domino pairs","title":"1128.number of equivalent domino pairs","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/#.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"","category":"section"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"@lc app=leetcode id=1604 lang=python3","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"[1604] Alert Using Same Key-Card Three or More Times in a One Hour Period","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"#=\nLeetCode company workers use key-cards to unlock office doors. Each time a worker uses their key-card, the security system saves the worker's name and the time when it was used. The system emits an alert if any worker uses the key-card three or more times in a one-hour period.\n\nYou are given a list of strings keyName and keyTime where [keyName[i], keyTime[i]] corresponds to a person's name and the time when their key-card was used in a single day.\n\nAccess times are given in the 24-hour time format \"HH:MM\", such as \"23:51\" and \"09:49\".\n\nReturn a list of unique worker names who received an alert for frequent keycard use. Sort the names in ascending order alphabetically.\n\nNotice that \"10:00\" - \"11:00\" is considered to be within a one-hour period, while \"22:51\" - \"23:52\" is not considered to be within a one-hour period.\n\n\n\nExample 1:\n\nInput: keyName = [\"daniel\",\"daniel\",\"daniel\",\"luis\",\"luis\",\"luis\",\"luis\"], keyTime = [\"10:00\",\"10:40\",\"11:00\",\"09:00\",\"11:00\",\"13:00\",\"15:00\"]\nOutput: [\"daniel\"]\nExplanation: \"daniel\" used the keycard 3 times in a one-hour period (\"10:00\",\"10:40\", \"11:00\").\nExample 2:\n\nInput: keyName = [\"alice\",\"alice\",\"alice\",\"bob\",\"bob\",\"bob\",\"bob\"], keyTime = [\"12:01\",\"12:00\",\"18:00\",\"21:00\",\"21:20\",\"21:30\",\"23:00\"]\nOutput: [\"bob\"]\nExplanation: \"bob\" used the keycard 3 times in a one-hour period (\"21:00\",\"21:20\", \"21:30\").\nExample 3:\n\nInput: keyName = [\"john\",\"john\",\"john\"], keyTime = [\"23:58\",\"23:59\",\"00:01\"]\nOutput: []\nExample 4:\n\nInput: keyName = [\"leslie\",\"leslie\",\"leslie\",\"clare\",\"clare\",\"clare\",\"clare\"], keyTime = [\"13:00\",\"13:20\",\"14:00\",\"18:00\",\"18:51\",\"19:30\",\"19:49\"]\nOutput: [\"clare\",\"leslie\"]\n\n\nConstraints:\n\n1 <= keyName.length, keyTime.length <= 105\nkeyName.length == keyTime.length\nkeyTime[i] is in the format \"HH:MM\".\n[keyName[i], keyTime[i]] is unique.\n1 <= keyName[i].length <= 10\nkeyName[i] contains only lowercase English letters. =#","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"using Dates\nfunction alert_names(key_name::Vector{String}, key_time::Vector{String})\n    res = Vector{String}()\n    mp = Dict{String,Vector{Time}}()\n    for (idx, name) in enumerate(key_name)\n        if !haskey(mp, name)\n            mp[name] = String[]\n        end\n        push!(mp[name], Time(key_time[idx]))\n    end\n    for (name, time) in mp\n        sort!(time)\n        for idx in 1:(length(time) - 2)\n            time1h = time[idx] + Hour(1)\n            if time[idx + 1] <= time1h && time[idx + 2] <= time1h\n                push!(res, name)\n                break\n            end\n        end\n    end\n    return sort!(res)\nend","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"","category":"page"},{"location":"democards/problems/id/1604.alert-using-same-key-card-three-or-more-times-in-a-one-hour-period/","page":"1604.alert using same key card three or more times in a one hour period","title":"1604.alert using same key card three or more times in a one hour period","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/859.buddy-strings/#.buddy-strings","page":"859.buddy strings","title":"859.buddy strings","text":"","category":"section"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"\"\"\"\n@lc app=leetcode id=859 lang=python3\n\n[859] Buddy Strings\n\nhttps://leetcode.com/problems/buddy-strings/description/\n\nalgorithms\nEasy (27.78%)\nLikes:    792\nDislikes: 542\nTotal Accepted:    75.4K\nTotal Submissions: 252.1K\nTestcase Example:  '\"ab\"\\n\"ba\"'\n\nGiven two strings A and B of lowercase letters, return true if you can swap\ntwo letters in A so the result is equal to B, otherwise, return false.\n\nSwapping letters is defined as taking two indices i and j (0-indexed) such\nthat i != j and swapping the characters at A[i] and A[j]. For example,\nswapping at indices 0 and 2 in \"abcd\" results in \"cbad\".\n\n\nExample 1:\n\n\nInput: A = \"ab\", B = \"ba\"\nOutput: true\nExplanation: You can swap A[0] = 'a' and A[1] = 'b' to get \"ba\", which is\nequal to B.\n\n\nExample 2:\n\n\nInput: A = \"ab\", B = \"ab\"\nOutput: false\nExplanation: The only letters you can swap are A[0] = 'a' and A[1] = 'b',\nwhich results in \"ba\" != B.\n\n\nExample 3:\n\n\nInput: A = \"aa\", B = \"aa\"\nOutput: true\nExplanation: You can swap A[0] = 'a' and A[1] = 'a' to get \"aa\", which is\nequal to B.\n\n\nExample 4:\n\n\nInput: A = \"aaaaaaabc\", B = \"aaaaaaacb\"\nOutput: true\n\n\nExample 5:\n\n\nInput: A = \"\", B = \"aa\"\nOutput: false\n\n\n\nConstraints:\n\n\n0 <= A.length <= 20000\n0 <= B.length <= 20000\nA and B consist of lowercase letters.\n\n\n\n\n@lc code=start\n\"\"\"\nfunction buddy_strings(A::String, B::String)::Bool\n    if length(A) == length(B)\n        different_pairs = Pair{Char,Char}[]\n        for (a, b) in zip(A, B)\n            if a != b\n                push!(different_pairs, a => b)\n            end\n        end\n        if length(different_pairs) == 0","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"check if A contains at least 2 duplicate letters","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"            length(Set(A)) < length(A)\n        elseif length(different_pairs) == 2\n            ((x, y), (z, w)) = different_pairs\n            x == w && y == z\n        else\n            false\n        end\n    else\n        false\n    end\nend","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"","category":"page"},{"location":"democards/problems/id/859.buddy-strings/","page":"859.buddy strings","title":"859.buddy strings","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/#.valid-tic-tac-toe-state","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"","category":"section"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"\"\"\"\n@lc app=leetcode id=794 lang=python3\n\n[794] Valid Tic-Tac-Toe State\n\nhttps://leetcode.com/problems/valid-tic-tac-toe-state/description/\n\nalgorithms\nMedium (31.90%)\nLikes:    217\nDislikes: 634\nTotal Accepted:    26.7K\nTotal Submissions: 81.6K\nTestcase Example:  '[\"O  \",\"   \",\"   \"]'\n\nA Tic-Tac-Toe board is given as a string array board. Return True if and only\nif it is possible to reach this board position during the course of a valid\ntic-tac-toe game.\n\nThe board is a 3 x 3 array, and consists of characters \" \", \"X\", and \"O\".\nThe \" \" character represents an empty square.\n\nHere are the rules of Tic-Tac-Toe:\n\n\nPlayers take turns placing characters into empty squares (\" \").\nThe first player always places \"X\" characters, while the second player always\nplaces \"O\" characters.\n\"X\" and \"O\" characters are always placed into empty squares, never filled\nones.\nThe game ends when there are 3 of the same (non-empty) character filling any\nrow, column, or diagonal.\nThe game also ends if all squares are non-empty.\nNo more moves can be played if the game is over.\n\n\n\nExample 1:\nInput: board = [\"O  \", \"   \", \"   \"]\nOutput: false\nExplanation: The first player always plays \"X\".\n\nExample 2:\nInput: board = [\"XOX\", \" X \", \"   \"]\nOutput: false\nExplanation: Players take turns making moves.\n\nExample 3:\nInput: board = [\"XXX\", \"   \", \"OOO\"]\nOutput: false\n\nExample 4:\nInput: board = [\"XOX\", \"O O\", \"XOX\"]\nOutput: true\n\n\nNote:\n\n\nboard is a length-3 array of strings, where each string board[i] has length\n3.\nEach board[i][j] is a character in the set {\" \", \"X\", \"O\"}.\n\n\n\n\n@lc code=start\n\"\"\"\nfunction validTicTacToe(board::Array{Char})::Bool\n    n_X, n_O = 0, 0\n\n    for x in board\n        if x == 'X'\n            n_X += 1\n        elseif x == 'O'\n            n_O += 1\n        end\n    end\n\n    if n_O > n_X || n_X >= n_O + 2\n        false\n    elseif n_X >= 3\n        if n_X == n_O\n            if is_win(board, 'X')\n                false  # Impossible! n_X should == x_O + 1\n            else\n                true\n            end\n        else","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"@assert nX == nO + 1","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"            if is_win(board, 'O')\n                false  # Impossible!\n            else\n                true\n            end\n        end\n    else\n        true\n    end\nend\n\nfunction is_win(b, x)\n    return b[1] == b[2] == b[3] == x ||\n           b[4] == b[5] == b[6] == x ||\n           b[7] == b[8] == b[9] == x ||\n           b[1] == b[4] == b[7] == x ||\n           b[2] == b[5] == b[8] == x ||\n           b[3] == b[6] == b[9] == x ||\n           b[1] == b[5] == b[9] == x ||\n           b[3] == b[5] == b[7] == x\nend","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"","category":"page"},{"location":"democards/problems/id/794.valid-tic-tac-toe-state/","page":"794.valid tic tac toe state","title":"794.valid tic tac toe state","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/#.search-a-2d-matrix-ii","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"","category":"section"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"\"\"\"\n[240] Medium [Search a 2D Matrix II](https://leetcode.com/problems/search-a-2d-matrix-ii/description/)\n\nWrite an efficient algorithm that searches for a value in an *m* x *n* matrix. This matrix has the following properties:\n\n+ Integers in each row are sorted in ascending from left to right.\n+ Integers in each column are sorted in ascending from top to bottom.\n\n# Example:\n\nConsider the following matrix:\n","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"[     [1,   4,  7, 11, 15],     [2,   5,  8, 12, 19],     [3,   6,  9, 16, 22],     [10, 13, 14, 17, 24],     [18, 21, 23, 26, 30] ]","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"\nGiven target = `5`, return `true`.\n\nGiven target = `20`, return `false`.\n\"\"\"\nfunction search_matrix(matrix::Matrix{Int}, target::Int)::Bool\n    row, col = size(matrix)\n    i, j = row, 1\n\n    while (i > 0 && j <= col)\n        last = matrix[i, j]\n\n        if (last == target)\n            return true\n        elseif last > target\n            i -= 1\n        else\n            j += 1\n        end\n    end\n\n    return false\nend","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"","category":"page"},{"location":"democards/problems/id/240.search-a-2d-matrix-ii/","page":"240.search a 2d matrix ii","title":"240.search a 2d matrix ii","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/#.longest-valid-parentheses","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"","category":"section"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"\"\"\"\n@lc app=leetcode id=32 lang=python3\n\n[32] Longest Valid Parentheses\n\nhttps://leetcode.com/problems/longest-valid-parentheses/description/\n\nalgorithms\nHard (27.07%)\nLikes:    3745\nDislikes: 141\nTotal Accepted:    299.6K\nTotal Submissions: 1.1M\nTestcase Example:  '\"(()\"'\n\nGiven a string containing just the characters '(' and ')', find the length of\nthe longest valid (well-formed) parentheses substring.\n\nExample 1:\n\n\nInput: \"(()\"\nOutput: 2\nExplanation: The longest valid parentheses substring is \"()\"\n\n\nExample 2:\n\n\nInput: \")()())\"\nOutput: 4\nExplanation: The longest valid parentheses substring is \"()()\"\n\n\n\n\n@lc code=start\n\"\"\"\nfunction longest_valid_parentheses(s::String)::Int\n    dp = zeros(Int, length(s))\n    n = 0\n    for i in 2:length(s)\n        if s[i] == ')'\n            if s[i - 1] == '('","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"case 1: ()()","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"                dp[i] = i == 2 ? 2 : dp[i - 2] + 2\n            else","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"case 2: (())","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"                i₍ = i - dp[i - 1] - 1\n                if i₍ >= 1 && s[i₍] == '('\n                    if dp[i - 1] > 0\n                        dp[i] = dp[i - 1] + 2 + (i₍ == 1 ? 0 : dp[i₍ - 1])\n                    end\n                end\n            end\n            n = max(n, dp[i])\n        end\n    end\n    return n\nend","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"","category":"page"},{"location":"democards/problems/id/32.longest-valid-parentheses/","page":"32.longest valid parentheses","title":"32.longest valid parentheses","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/392.is-subsequence/#.is-subsequence","page":"392.is subsequence","title":"392.is subsequence","text":"","category":"section"},{"location":"democards/problems/id/392.is-subsequence/","page":"392.is subsequence","title":"392.is subsequence","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/392.is-subsequence/","page":"392.is subsequence","title":"392.is subsequence","text":"\"\"\"\n@lc app=leetcode id=392 lang=python3\n\n[392] Is Subsequence\n\nhttps://leetcode.com/problems/is-subsequence/description/\n\nalgorithms\nEasy (47.83%)\nLikes:    1910\nDislikes: 218\nTotal Accepted:    249.5K\nTotal Submissions: 504.8K\nTestcase Example:  '\"abc\"\\n\"ahbgdc\"'\n\nGiven a string s and a string t, check if s is subsequence of t.\n\nA subsequence of a string is a new string which is formed from the original\nstring by deleting some (can be none) of the characters without disturbing\nthe relative positions of the remaining characters. (ie, \"ace\" is a\nsubsequence of \"abcde\" while \"aec\" is not).\n\nFollow up:\nIf there are lots of incoming S, say S1, S2, ... , Sk where k >= 1B, and you\nwant to check one by one to see if T has its subsequence. In this scenario,\nhow would you change your code?\n\nCredits:\nSpecial thanks to @pbrother for adding this problem and creating all test\ncases.\n\n\nExample 1:\nInput: s = \"abc\", t = \"ahbgdc\"\nOutput: true\nExample 2:\nInput: s = \"axc\", t = \"ahbgdc\"\nOutput: false\n\n\nConstraints:\n\n\n0 <= s.length <= 100\n0 <= t.length <= 10^4\nBoth strings consists only of lowercase characters.\n\n\n\n\n@lc code=start\n\"\"\"\nfunction is_subsequence(s::String, t::String)::Bool\n    if length(s) == 0\n        true\n    else\n        i, j = 1, 1\n        while j <= length(t)\n            if s[i] == t[j]\n                i += 1\n                if i > length(s)\n                    return true\n                end\n            end\n            j += 1\n        end\n        false\n    end\nend","category":"page"},{"location":"democards/problems/id/392.is-subsequence/","page":"392.is subsequence","title":"392.is subsequence","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/392.is-subsequence/","page":"392.is subsequence","title":"392.is subsequence","text":"","category":"page"},{"location":"democards/problems/id/392.is-subsequence/","page":"392.is subsequence","title":"392.is subsequence","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/#.best-time-to-buy-and-sell-stock-ii","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"","category":"section"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"@lc app=leetcode id=122 lang=julia","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"[122] Best Time to Buy and Sell Stock II","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Say you have an array prices for which the ith element is the price of a given stock on day i.","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Design an algorithm to find the maximum profit. You may complete as many transactions as you like (i.e., buy one and sell one share of the stock multiple times).","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Note: You may not engage in multiple transactions at the same time (i.e., you must sell the stock before you buy again).","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Example 1:","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Input: [7,1,5,3,6,4] Output: 7 Explanation: Buy on day 2 (price = 1) and sell on day 3 (price = 5), profit = 5-1 = 4.              Then buy on day 4 (price = 3) and sell on day 5 (price = 6), profit = 6-3 = 3. Example 2:","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Input: [1,2,3,4,5] Output: 4 Explanation: Buy on day 1 (price = 1) and sell on day 5 (price = 5), profit = 5-1 = 4.              Note that you cannot buy on day 1, buy on day 2 and sell them later, as you are              engaging multiple transactions at the same time. You must sell before buying again. Example 3:","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Input: [7,6,4,3,1] Output: 0 Explanation: In this case, no transaction is done, i.e. max profit = 0.","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"Constraints:","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"1 <= prices.length <= 3 * 10 ^ 4 0 <= prices[i] <= 10 ^ 4 @lc code=start","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"function max_profit(prices::Vector{Int})::Int\n    res = 0\n    for i in 2:length(prices)\n        res += (prices[i] > prices[i - 1]) ? (prices[i] - prices[i - 1]) : 0\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"","category":"page"},{"location":"democards/problems/id/122.best-time-to-buy-and-sell-stock-ii/","page":"122.best time to buy and sell stock ii","title":"122.best time to buy and sell stock ii","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/709.to-lower-case/#.to-lower-case","page":"709.to lower case","title":"709.to lower case","text":"","category":"section"},{"location":"democards/problems/id/709.to-lower-case/","page":"709.to lower case","title":"709.to lower case","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/709.to-lower-case/","page":"709.to lower case","title":"709.to lower case","text":"\"\"\"\n@lc app=leetcode id=709 lang=python3\n\n[709] To Lower Case\n\nhttps://leetcode.com/problems/to-lower-case/description/\n\nalgorithms\nEasy (78.27%)\nLikes:    562\nDislikes: 1692\nTotal Accepted:    234K\nTotal Submissions: 293.3K\nTestcase Example:  '\"Hello\"'\n\nImplement function ToLowerCase() that has a string parameter str, and returns\nthe same string in lowercase.\n\n\n\n\nExample 1:\n\n\nInput: \"Hello\"\nOutput: \"hello\"\n\n\n\nExample 2:\n\n\nInput: \"here\"\nOutput: \"here\"\n\n\n\nExample 3:\n\n\nInput: \"LOVELY\"\nOutput: \"lovely\"\n\n\n\n\n\n\n@lc code=start\n\"\"\"\nfunction toLowerCase(s::String)::String\n    return lowercase(s)\nend","category":"page"},{"location":"democards/problems/id/709.to-lower-case/","page":"709.to lower case","title":"709.to lower case","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/709.to-lower-case/","page":"709.to lower case","title":"709.to lower case","text":"","category":"page"},{"location":"democards/problems/id/709.to-lower-case/","page":"709.to lower case","title":"709.to lower case","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/204.count-primes/#.count-primes","page":"204.count primes","title":"204.count primes","text":"","category":"section"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"@lc app=leetcode id=204 lang=python3","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"[204] Count Primes","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"\"\"\"\nCount the number of prime numbers less than a non-negative number, n.\n\n\n\nExample 1:\n\nInput: n = 10\nOutput: 4\nExplanation: There are 4 prime numbers less than 10, they are 2, 3, 5, 7.\nExample 2:\n\nInput: n = 0\nOutput: 0\nExample 3:\n\nInput: n = 1\nOutput: 0\n\n\nConstraints:\n\n0 <= n <= 5 * 106\n\"\"\"","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"function count_primes(n::Int)\n    if n <= 1\n        return 0\n    end\n    arr = fill(true, n - 1)\n    for i in 2 : n - 1\n        for j in i ^ 2 : i : (n - 1)\n            arr[j] = false\n        end\n    end\n    return sum(arr) - 1\nend","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"","category":"page"},{"location":"democards/problems/id/204.count-primes/","page":"204.count primes","title":"204.count primes","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/543.diameter-of-binary-tree/#.diameter-of-binary-tree","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"","category":"section"},{"location":"democards/problems/id/543.diameter-of-binary-tree/","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/543.diameter-of-binary-tree/","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"@doc doc\"\"\"\n@lc app=leetcode id=543 lang=python3\n\n[543] Diameter of Binary Tree\n\nhttps://leetcode.com/problems/diameter-of-binary-tree/description/\n\nalgorithms\nEasy (48.12%)\nLikes:    3749\nDislikes: 223\nTotal Accepted:    393.5K\nTotal Submissions: 806.4K\nTestcase Example:  '[1,2,3,4,5]'\n\n\nGiven a binary tree, you need to compute the length of the diameter of the\ntree. The diameter of a binary tree is the length of the longest path between\nany two nodes in a tree. This path may or may not pass through the root.\n\n\n\nExample:\nGiven a binary tree\n\n⁠         1\n⁠        / \\\n⁠       2   3\n⁠      / \\\n⁠     4   5\n\n\n\nReturn 3, which is the length of the path [4,2,1,3] or [5,2,1,3].\n\n\nNote:\nThe length of path between two nodes is represented by the number of edges\nbetween them.\n\n\n\n@lc code=start\n\"\"\"\nfunction diameter_of_binary_tree(root::TreeNode)::Int\n    return max(\n        diameter_of_binary_tree(root.left),\n        diameter_of_binary_tree(root.right),\n        _max_depth_to_leaf(root.left) + _max_depth_to_leaf(root.right) + 1,\n    ) - 1\nend\n\ndiameter_of_binary_tree(root::Nothing) = 0\n\nfunction _max_depth_to_leaf(root::TreeNode)\n    return max(1 + _max_depth_to_leaf(root.left), 1 + _max_depth_to_leaf(root.right))\nend\n\n_max_depth_to_leaf(::Nothing) = 0","category":"page"},{"location":"democards/problems/id/543.diameter-of-binary-tree/","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/543.diameter-of-binary-tree/","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"","category":"page"},{"location":"democards/problems/id/543.diameter-of-binary-tree/","page":"543.diameter of binary tree","title":"543.diameter of binary tree","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/120.triangle/#.triangle","page":"120.triangle","title":"120.triangle","text":"","category":"section"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"@lc app=leetcode id=120 lang=julia","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"[120] Triangle","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"Given a triangle, find the minimum path sum from top to bottom. Each step you may move to adjacent numbers on the row below.","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"For example, given the following triangle","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"[      [2],     [3,4],    [6,5,7],   [4,1,8,3] ] The minimum path sum from top to bottom is 11 (i.e., 2 + 3 + 5 + 1 = 11).","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"Note:","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"Bonus point if you are able to do this using only O(n) extra space, where n is the total number of rows in the triangle. @lc code=start","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"function minimum_total(triangle::Vector{Vector{Int}})\n    length(triangle) == 1 && return triangle[1][1]\n    dp = fill(0, length(triangle))\n    tmp = dp[:]\n    dp[1:2] = triangle[2] .+ triangle[1][1]\n    for i in 3:length(triangle)\n        tmp[1] = dp[1] + triangle[i][1]\n        for j in 2:(i - 1)\n            tmp[j] = min(dp[j], dp[j - 1]) + triangle[i][j]\n        end\n        tmp[i] = dp[i - 1] + triangle[i][i]\n        tmp, dp = dp, tmp\n    end\n    return minimum(dp)\nend","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"","category":"page"},{"location":"democards/problems/id/120.triangle/","page":"120.triangle","title":"120.triangle","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/767.reorganize-string/#.reorganize-string","page":"767.reorganize string","title":"767.reorganize string","text":"","category":"section"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"@lc app=leetcode id=767 lang=python3","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"[767] Reorganize String","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"\"\"\"\nGiven a string S, check if the letters can be rearranged so that two characters that are adjacent to each other are not the same.\n\nIf possible, output any possible result.  If not possible, return the empty string.\n\nExample 1:\n\nInput: S = \"aab\"\nOutput: \"aba\"\nExample 2:\n\nInput: S = \"aaab\"\nOutput: \"\"\nNote:\n\nS will consist of lowercase letters and have length in range [1, 500].\n\"\"\"","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"function reorganize_string(S::String)\n    char_arr = codeunits(S)\n    ascii_a, len = Int('a'), length(S)\n    mp = fill(0, 26)\n    for ch in char_arr\n        mp[ch - ascii_a + 1] += 1\n    end\n    max_freq = argmax(mp)\n    if mp[max_freq] > (len + 1) ÷ 2\n        return \"\"\n    end\n    res = fill('a', len)\n    idx = 1\n    for i in 1:mp[max_freq]\n        res[idx] = Char(max_freq + ascii_a - 1)\n        idx += 2\n    end\n    mp[max_freq] = 0\n    for i in 1:26\n        for j in 1:mp[i]\n            (idx > len) && (idx = 2)\n            res[idx] = Char(i + ascii_a - 1)\n            idx += 2\n        end\n    end","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"println(res)","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"    return String(res)\nend","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"","category":"page"},{"location":"democards/problems/id/767.reorganize-string/","page":"767.reorganize string","title":"767.reorganize string","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"#LeetCode","page":"Home","title":"LeetCode","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"The solution set to LeetCode problems!","category":"page"},{"location":"democards/problems/id/124.binary-tree-maximum-path-sum/#.binary-tree-maximum-path-sum","page":"124.binary tree maximum path sum","title":"124.binary tree maximum path sum","text":"","category":"section"},{"location":"democards/problems/id/124.binary-tree-maximum-path-sum/","page":"124.binary tree maximum path sum","title":"124.binary tree maximum path sum","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/124.binary-tree-maximum-path-sum/","page":"124.binary tree maximum path sum","title":"124.binary tree maximum path sum","text":"@doc doc\"\"\"\n@lc app=leetcode id=124 lang=python3\n\n[124] Binary Tree Maximum Path Sum\n\nhttps://leetcode.com/problems/binary-tree-maximum-path-sum/description/\n\nalgorithms\nHard (31.97%)\nLikes:    4403\nDislikes: 331\nTotal Accepted:    415.6K\nTotal Submissions: 1.2M\nTestcase Example:  '[1,2,3]'\n\nGiven a non-empty binary tree, find the maximum path sum.\n\nFor this problem, a path is defined as any sequence of nodes from some\nstarting node to any node in the tree along the parent-child connections. The\npath must contain at least one node and does not need to go through the\nroot.\n\nExample 1:\n\n\nInput: [1,2,3]\n\n⁠      1\n⁠     / \\\n⁠    2   3\n\nOutput: 6\n\n\nExample 2:\n\n\nInput: [-10,9,20,null,null,15,7]\n\n-10\n/ \\\n9  20\n/  \\\n15   7\n\nOutput: 42\n\n\n\n\n@lc code=start\n\"\"\"\nfunction max_path_sum(root::TreeNode)\n    max_val = typemin(Int)\n\n    function max_sum_to_leaf(x)\n        isnothing(x) && return 0\n        left = max_sum_to_leaf(x.left)\n        right = max_sum_to_leaf(x.right)\n        max_val = max(max_val, left + x.val + right)\n        return max(0, x.val + max(left, right))\n    end\n\n    max_sum_to_leaf(root)\n    return max_val\nend","category":"page"},{"location":"democards/problems/id/124.binary-tree-maximum-path-sum/","page":"124.binary tree maximum path sum","title":"124.binary tree maximum path sum","text":"","category":"page"},{"location":"democards/problems/id/124.binary-tree-maximum-path-sum/","page":"124.binary tree maximum path sum","title":"124.binary tree maximum path sum","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1260.shift-2-d-grid/#.shift-2-d-grid","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"","category":"section"},{"location":"democards/problems/id/1260.shift-2-d-grid/","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1260.shift-2-d-grid/","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"\"\"\"\n@lc app=leetcode id=1260 lang=python3\n\n[1260] Shift 2D Grid\n\nhttps://leetcode.com/problems/shift-2d-grid/description/\n\nalgorithms\nEasy (59.85%)\nLikes:    262\nDislikes: 97\nTotal Accepted:    21.1K\nTotal Submissions: 34.3K\nTestcase Example:  '[[1,2,3],[4,5,6],[7,8,9]]\\n1'\n\nGiven a 2D grid of size m x n and an integer k. You need to shift the grid k\ntimes.\n\nIn one shift operation:\n\n\nElement at grid[i][j] moves to grid[i][j + 1].\nElement at grid[i][n - 1] moves to grid[i + 1][0].\nElement at grid[m - 1][n - 1] moves to grid[0][0].\n\n\nReturn the 2D grid after applying shift operation k times.\n\n\nExample 1:\n\n\nInput: grid = [[1,2,3],[4,5,6],[7,8,9]], k = 1\nOutput: [[9,1,2],[3,4,5],[6,7,8]]\n\n\nExample 2:\n\n\nInput: grid = [[3,8,1,9],[19,7,2,5],[4,6,11,10],[12,0,21,13]], k = 4\nOutput: [[12,0,21,13],[3,8,1,9],[19,7,2,5],[4,6,11,10]]\n\n\nExample 3:\n\n\nInput: grid = [[1,2,3],[4,5,6],[7,8,9]], k = 9\nOutput: [[1,2,3],[4,5,6],[7,8,9]]\n\n\n\nConstraints:\n\n\nm == grid.length\nn == grid[i].length\n1 <= m <= 50\n1 <= n <= 50\n-1000 <= grid[i][j] <= 1000\n0 <= k <= 100\n\n\n\n\n@lc code=start\n\"\"\"\nfunction shift_grid(grid::Matrix{Int}, k::Int)::Matrix{Int}\n    A = grid'\n    res = Matrix(undef, size(A)...)\n    LI = LinearIndices(A)\n\n    for i in LI\n        i′ = mod1(i + k, length(LI))\n        res[i′] = A[i]\n    end\n    return res'\nend","category":"page"},{"location":"democards/problems/id/1260.shift-2-d-grid/","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/1260.shift-2-d-grid/","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"","category":"page"},{"location":"democards/problems/id/1260.shift-2-d-grid/","page":"1260.shift 2 d grid","title":"1260.shift 2 d grid","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/7.reverse-integer/#.reverse-integer","page":"7.reverse integer","title":"7.reverse integer","text":"","category":"section"},{"location":"democards/problems/id/7.reverse-integer/","page":"7.reverse integer","title":"7.reverse integer","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/7.reverse-integer/","page":"7.reverse integer","title":"7.reverse integer","text":"\"\"\"\n@lc app=leetcode id=7 lang=python3\n\n[7] Reverse Integer\n\nhttps://leetcode.com/problems/reverse-integer/description/\n\nalgorithms\nEasy (25.60%)\nLikes:    2755\nDislikes: 4283\nTotal Accepted:    916.1K\nTotal Submissions: 3.6M\nTestcase Example:  '123'\n\nGiven a 32-bit signed integer, reverse digits of an integer.\n\nExample 1:\n\n\nInput: 123\nOutput: 321\n\n\nExample 2:\n\n\nInput: -123\nOutput: -321\n\n\nExample 3:\n\n\nInput: 120\nOutput: 21\n\n\nNote:\nAssume we are dealing with an environment which could only store integers\nwithin the 32-bit signed integer range: [−2^31,  2^31 − 1]. For the purpose\nof this problem, assume that your function returns 0 when the reversed\ninteger overflows.\n\n\n\n@lc code=start\n\"\"\"\nfunction reverse_integer(x::Int32)::Int\n    s = sign(x)\n    r = parse(Int, reverse(string(s * x)))\n    return r <= typemax(Int32) ? s * r : 0\nend","category":"page"},{"location":"democards/problems/id/7.reverse-integer/","page":"7.reverse integer","title":"7.reverse integer","text":"","category":"page"},{"location":"democards/problems/id/7.reverse-integer/","page":"7.reverse integer","title":"7.reverse integer","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/#.median-of-two-sorted-arrays","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"","category":"section"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"\"\"\"\n@lc app=leetcode id=4 lang=python3\n\n[4] Median of Two Sorted Arrays\n\nhttps://leetcode.com/problems/median-of-two-sorted-arrays/description/\n\nalgorithms\nHard (28.09%)\nLikes:    5722\nDislikes: 857\nTotal Accepted:    574.5K\nTotal Submissions: 2M\nTestcase Example:  '[1,3]\\n[2]'\n\nThere are two sorted arrays nums1 and nums2 of size m and n respectively.\n\nFind the median of the two sorted arrays. The overall run time complexity\nshould be O(log (m+n)).\n\nYou may assume nums1 and nums2 cannot be both empty.\n\nExample 1:\n\n\nnums1 = [1, 3]\nnums2 = [2]\n\nThe median is 2.0\n\n\nExample 2:\n\n\nnums1 = [1, 2]\nnums2 = [3, 4]\n\nThe median is (2 + 3)/2 = 2.5\n\n\n\n\n@lc code=start\n\"\"\"\nfunction find_median_sorted_arrays(nums1::Vector{Int}, nums2::Vector{Int})::Float64\n    n = length(nums1) + length(nums2)\n    if isodd(n)\n        nth(nums1, nums2, n ÷ 2 + 1)\n    else\n        (nth(nums1, nums2, n ÷ 2) + nth(nums1, nums2, n ÷ 2 + 1)) / 2\n    end\nend\n\nfunction nth(a, b, k)\n    if isempty(a)\n        b[k]\n    elseif isempty(b)\n        a[k]\n    else\n        ia, ib = cld(length(a), 2), cld(length(b), 2)\n        ma, mb = a[ia], b[ib]\n        if ia + ib <= k\n            if ma > mb","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"we can safely ignore the first half in b","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"                nth(a, @view(b[(ib + 1):end]), k - ib)\n            else\n                nth(@view(a[(ia + 1):end]), b, k - ia)\n            end\n        else\n            if ma > mb\n                nth(@view(a[1:(ia - 1)]), b, k)\n            else\n                nth(a, @view(b[1:(ib - 1)]), k)\n            end\n        end\n    end\nend","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"","category":"page"},{"location":"democards/problems/id/4.median-of-two-sorted-arrays/","page":"4.median of two sorted arrays","title":"4.median of two sorted arrays","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/514.freedom-trail/#.freedom-trail","page":"514.freedom trail","title":"514.freedom trail","text":"","category":"section"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"@lc app=leetcode id=514 lang=python3","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"[514] Freedom Trail","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"In the video game Fallout 4, the quest \"Road to Freedom\" requires players to reach a metal dial called the \"Freedom Trail Ring\", and use the dial to spell a specific keyword in order to open the door.","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"Given a string ring, which represents the code engraved on the outer ring and another string key, which represents the keyword needs to be spelled. You need to find the minimum number of steps in order to spell all the characters in the keyword.","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"Initially, the first character of the ring is aligned at 12:00 direction. You need to spell all the characters in the string key one by one by rotating the ring clockwise or anticlockwise to make each character of the string key aligned at 12:00 direction and then by pressing the center button.","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"At the stage of rotating the ring to spell the key character key[i]:","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"You can rotate the ring clockwise or anticlockwise one place, which counts as 1 step. The final purpose of the rotation is to align one of the string ring's characters at the 12:00 direction, where this character must equal to the character key[i]. If the character key[i] has been aligned at the 12:00 direction, you need to press the center button to spell, which also counts as 1 step. After the pressing, you could begin to spell the next character in the key (next stage), otherwise, you've finished all the spelling. Example:","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"Input: ring = \"godding\", key = \"gd\" Output: 4 Explanation: For the first key character 'g', since it is already in place, we just need 1 step to spell this character. For the second key character 'd', we need to rotate the ring \"godding\" anticlockwise by two steps to make it become \"ddinggo\". Also, we need 1 more step for spelling. So the final output is 4. Note:","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"Length of both ring and key will be in range 1 to 100. There are only lowercase letters in both strings and might be some duplcate characters in both strings. It's guaranteed that string key could always be spelled by rotating the string ring. @lc code=start","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"function find_rotate_steps(ring::String, key::String)\n    lenr, lenk = length(ring), length(key)\n    dp1 = fill(typemax(Int), lenr)\n    dp2 = dp1[:]\n    mp = [Int[] for i in 1:26]\n    for i in 1:lenr\n        push!(mp[ring[i] - 'a' + 1], i)\n    end\n    for idx in mp[key[1] - 'a' + 1]\n        dp1[idx] = min(idx - 1, lenr - idx)\n    end\n    for i in 2:lenk\n        for idx1 in mp[key[i] - 'a' + 1]\n            for idx2 in mp[key[i - 1] - 'a' + 1]\n                dp2[idx1] = min(\n                    dp2[idx1], dp1[idx2] + min(abs(idx2 - idx1), lenr - abs(idx2 - idx1))\n                )\n            end\n        end\n        dp1, dp2 = dp2, dp1\n        dp2 .= typemax(Int)\n    end\n    return minimum(dp1) + lenk\nend","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"","category":"page"},{"location":"democards/problems/id/514.freedom-trail/","page":"514.freedom trail","title":"514.freedom trail","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/396.rotate-function/#.rotate-function","page":"396.rotate function","title":"396.rotate function","text":"","category":"section"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"\"\"\"\n@lc app=leetcode id=396 lang=python3\n\n[396] Rotate Function\n\nhttps://leetcode.com/problems/rotate-function/description/\n\nalgorithms\nMedium (35.71%)\nLikes:    435\nDislikes: 140\nTotal Accepted:    45.9K\nTotal Submissions: 125.7K\nTestcase Example:  '[]'\n\n\nGiven an array of integers A and let n to be its length.\n\n\n\nAssume Bk to be an array obtained by rotating the array A k positions\nclock-wise, we define a \"rotation function\" F on A as follow:\n\n\n\nF(k) = 0 * Bk[0] + 1 * Bk[1] + ... + (n-1) * Bk[n-1].\n\nCalculate the maximum value of F(0), F(1), ..., F(n-1).\n\n\nNote:\nn is guaranteed to be less than 10^5.\n\n\nExample:\n\nA = [4, 3, 2, 6]\n\nF(0) = (0 * 4) + (1 * 3) + (2 * 2) + (3 * 6) = 0 + 3 + 4 + 18 = 25\nF(1) = (0 * 6) + (1 * 4) + (2 * 3) + (3 * 2) = 0 + 4 + 6 + 6 = 16\nF(2) = (0 * 2) + (1 * 6) + (2 * 4) + (3 * 3) = 0 + 6 + 8 + 9 = 23\nF(3) = (0 * 3) + (1 * 2) + (2 * 6) + (3 * 4) = 0 + 2 + 12 + 12 = 26\n\nSo the maximum value of F(0), F(1), F(2), F(3) is F(3) = 26.\n\n\n\n\n@lc code=start\n\"\"\"\nfunction max_rotate_function(A::Vector{Int})::Int","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"f(i+1) = f(i) + ∑(A) - A[end] * length(A)","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"    s = sum(A)\n    n = length(A)\n    cur = sum(k -> (k - 1) * A[k], 1:n)\n    res = cur\n    for i in n:-1:2\n        cur += s - n * A[i]\n        res = max(res, cur)\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"","category":"page"},{"location":"democards/problems/id/396.rotate-function/","page":"396.rotate function","title":"396.rotate function","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/134.gas-station/#.gas-station","page":"134.gas station","title":"134.gas station","text":"","category":"section"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"@lc app=leetcode id=134 lang=python3","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"[134] Gas Station","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"\"\"\"\nThere are N gas stations along a circular route, where the amount of gas at station i is gas[i].\n\nYou have a car with an unlimited gas tank and it costs cost[i] of gas to travel from station i to its next station (i+1). You begin the journey with an empty tank at one of the gas stations.\n\nReturn the starting gas station's index if you can travel around the circuit once in the clockwise direction, otherwise return -1.\n\nNote:\n\nIf there exists a solution, it is guaranteed to be unique.\nBoth input arrays are non-empty and have the same length.\nEach element in the input arrays is a non-negative integer.\nExample 1:","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Input: gas  = [1,2,3,4,5] cost = [3,4,5,1,2]","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Output: 3","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Explanation: Start at station 3 (index 3) and fill up with 4 unit of gas. Your tank = 0 + 4 = 4 Travel to station 4. Your tank = 4 - 1 + 5 = 8 Travel to station 0. Your tank = 8 - 2 + 1 = 7 Travel to station 1. Your tank = 7 - 3 + 2 = 6 Travel to station 2. Your tank = 6 - 4 + 3 = 5 Travel to station 3. The cost is 5. Your gas is just enough to travel back to station 3. Therefore, return 3 as the starting index.","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Example 2:","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Input: gas  = [2,3,4] cost = [3,4,3]","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Output: -1","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"Explanation: You can't start at station 0 or 1, as there is not enough gas to travel to the next station. Let's start at station 2 and fill up with 4 unit of gas. Your tank = 0 + 4 = 4 Travel to station 0. Your tank = 4 - 3 + 2 = 3 Travel to station 1. Your tank = 3 - 3 + 3 = 3 You cannot travel back to station 2, as it requires 4 unit of gas but you only have 3. Therefore, you can't travel around the circuit once no matter where you start.","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"\"\"\"","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"function can_complete_circuit(gas::Vector{Int}, cost::Vector{Int})\n    gas .-= cost\n    accumulate!(+, gas, gas)\n    if gas[end] < 0\n        return -1\n    end\n    return argmin(gas) % length(gas)\nend","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"","category":"page"},{"location":"democards/problems/id/134.gas-station/","page":"134.gas station","title":"134.gas station","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/201.bitwise-and-of-numbers-range/#.bitwise-and-of-numbers-range","page":"201.bitwise and of numbers range","title":"201.bitwise and of numbers range","text":"","category":"section"},{"location":"democards/problems/id/201.bitwise-and-of-numbers-range/","page":"201.bitwise and of numbers range","title":"201.bitwise and of numbers range","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/201.bitwise-and-of-numbers-range/","page":"201.bitwise and of numbers range","title":"201.bitwise and of numbers range","text":"\"\"\"\n@lc app=leetcode id=201 lang=python3\n\n[201] Bitwise AND of Numbers Range\n\nhttps://leetcode.com/problems/bitwise-and-of-numbers-range/description/\n\nalgorithms\nMedium (36.95%)\nLikes:    1092\nDislikes: 128\nTotal Accepted:    158.1K\nTotal Submissions: 401.2K\nTestcase Example:  '5\\n7'\n\nGiven a range [m, n] where 0 <= m <= n <= 2147483647, return the bitwise AND\nof all numbers in this range, inclusive.\n\nExample 1:\n\n\nInput: [5,7]\nOutput: 4\n\n\nExample 2:\n\n\nInput: [0,1]\nOutput: 0\n\n\n@lc code=start\n\"\"\"\nfunction range_bitwise_and(m::Int, n::Int)::Int\n    i = 0\n    while m != n\n        m >>= 1\n        n >>= 1\n        i += 1\n    end\n    return n << i\nend","category":"page"},{"location":"democards/problems/id/201.bitwise-and-of-numbers-range/","page":"201.bitwise and of numbers range","title":"201.bitwise and of numbers range","text":"","category":"page"},{"location":"democards/problems/id/201.bitwise-and-of-numbers-range/","page":"201.bitwise and of numbers range","title":"201.bitwise and of numbers range","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/5.longest-palindromic-substring/#.longest-palindromic-substring","page":"5.longest palindromic substring","title":"5.longest palindromic substring","text":"","category":"section"},{"location":"democards/problems/id/5.longest-palindromic-substring/","page":"5.longest palindromic substring","title":"5.longest palindromic substring","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/5.longest-palindromic-substring/","page":"5.longest palindromic substring","title":"5.longest palindromic substring","text":"\"\"\"\n\n@lc app=leetcode id=5 lang=python3\n\n[5] Longest Palindromic Substring\n\nhttps://leetcode.com/problems/longest-palindromic-substring/description/\n\nalgorithms\nMedium (28.55%)\nLikes:    7706\nDislikes: 565\nTotal Accepted:    1M\nTotal Submissions: 3.4M\nTestcase Example:  '\"babad\"'\n\nGiven a string s, find the longest palindromic substring in s. You may assume\nthat the maximum length of s is 1000.\n\nExample 1:\n\n\nInput: \"babad\"\nOutput: \"bab\"\nNote: \"aba\" is also a valid answer.\n\n\nExample 2:\n\n\nInput: \"cbbd\"\nOutput: \"bb\"\n\n\n\n\n@lc code=start\n\"\"\"\nfunction longest_palindrome(s::String)::AbstractString\n    res = \"\"\n    for i in 1:length(s)\n        s_odd = _longest_palindrome(s, i, i)\n        if length(s_odd) > length(res)\n            res = s_odd\n        end\n        s_even = _longest_palindrome(s, i, i + 1)\n        if length(s_even) > length(res)\n            res = s_even\n        end\n    end\n    return res\nend\n\nfunction _longest_palindrome(s, l, r)\n    while l >= 1 && r <= length(s) && s[l] == s[r]\n        l -= 1\n        r += 1\n    end\n    return SubString(s, l + 1, r - 1)\nend","category":"page"},{"location":"democards/problems/id/5.longest-palindromic-substring/","page":"5.longest palindromic substring","title":"5.longest palindromic substring","text":"","category":"page"},{"location":"democards/problems/id/5.longest-palindromic-substring/","page":"5.longest palindromic substring","title":"5.longest palindromic substring","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/#.4-sum-ii","page":"454.4 sum ii","title":"454.4 sum ii","text":"","category":"section"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"@lc app=leetcode id=454 lang=Julia","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"[454] 4Sum II","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"\"\"\"\nGiven four lists A, B, C, D of integer values, compute how many tuples (i, j, k, l) there are such that A[i] + B[j] + C[k] + D[l] is zero.\n\nTo make problem a bit easier, all A, B, C, D have same length of N where 0 ≤ N ≤ 500. All integers are in the range of -228 to 228 - 1 and the result is guaranteed to be at most 231 - 1.\n\nExample:\n\nInput:\nA = [ 1, 2]\nB = [-2,-1]\nC = [-1, 2]\nD = [ 0, 2]\n\nOutput:\n2\n\nExplanation:\nThe two tuples are:\n1. (0, 0, 0, 1) -> A[0] + B[0] + C[0] + D[1] = 1 + (-2) + (-1) + 2 = 0\n2. (1, 1, 0, 0) -> A[1] + B[1] + C[0] + D[0] = 2 + (-1) + (-1) + 0 = 0\n\"\"\"\nfunction four_sum_count(A::Vector{Int}, B::Vector{Int}, C::Vector{Int}, D::Vector{Int})::Int\n    dic = counter([a + b for a in A for b in B])\n    return sum(get(dic, -c - d, 0) for c in C for d in D)\nend","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"","category":"page"},{"location":"democards/problems/id/454.4-sum-ii/","page":"454.4 sum ii","title":"454.4 sum ii","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/6.zig-zag-conversion/#.zig-zag-conversion","page":"6.zig zag conversion","title":"6.zig zag conversion","text":"","category":"section"},{"location":"democards/problems/id/6.zig-zag-conversion/","page":"6.zig zag conversion","title":"6.zig zag conversion","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/6.zig-zag-conversion/","page":"6.zig zag conversion","title":"6.zig zag conversion","text":"\"\"\"\n@lc app=leetcode id=6 lang=python3\n\n[6] ZigZag Conversion\n\nhttps://leetcode.com/problems/zigzag-conversion/description/\n\nalgorithms\nMedium (34.34%)\nLikes:    1799\nDislikes: 4839\nTotal Accepted:    481.5K\nTotal Submissions: 1.3M\nTestcase Example:  '\"PAYPALISHIRING\"\\n3'\n\nThe string \"PAYPALISHIRING\" is written in a zigzag pattern on a given number\nof rows like this: (you may want to display this pattern in a fixed font for\nbetter legibility)\n\n\nP   A   H   N\nA P L S I I G\nY   I   R\n\n\nAnd then read line by line: \"PAHNAPLSIIGYIR\"\n\nWrite the code that will take a string and make this conversion given a\nnumber of rows:\n\n\nstring convert(string s, int numRows);\n\nExample 1:\n\n\nInput: s = \"PAYPALISHIRING\", numRows = 3\nOutput: \"PAHNAPLSIIGYIR\"\n\n\nExample 2:\n\n\nInput: s = \"PAYPALISHIRING\", numRows = 4\nOutput: \"PINALSIGYAHRPI\"\nExplanation:\n\nP     I    N\nA   L S  I G\nY A   H R\nP     I\n\n\n\n@lc code=start\n\"\"\"\nfunction zig_zag_convert(s::String, num_rows::Int)::String\n    if num_rows == 1 || num_rows >= length(s)\n        s\n    else\n        table = [Char[] for _ in 1:num_rows]\n        i, dir = 1, 1\n        for x in s\n            push!(table[i], x)\n            if i == 1\n                dir = 1\n            elseif i == num_rows\n                dir = -1\n            end\n            i += dir\n        end\n        join(Iterators.flatten(table))\n    end\nend","category":"page"},{"location":"democards/problems/id/6.zig-zag-conversion/","page":"6.zig zag conversion","title":"6.zig zag conversion","text":"","category":"page"},{"location":"democards/problems/id/6.zig-zag-conversion/","page":"6.zig zag conversion","title":"6.zig zag conversion","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/#.sell-diminishing-valued-colored-balls","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"","category":"section"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"@lc app=leetcode id=5563 lang=julia","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"[5563] Sell Diminishing-Valued Colored Balls","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"#=\nYou have an inventory of different colored balls, and there is a customer that wants orders balls of any color.\n\nThe customer weirdly values the colored balls. Each colored ball's value is the number of balls of that color you currently have in your inventory. For example, if you own 6 yellow balls, the customer would pay 6 for the first yellow ball. After the transaction, there are only 5 yellow balls left, so the next yellow ball is then valued at 5 (i.e., the value of the balls decreases as you sell more to the customer).\n\nYou are given an integer array, inventory, where inventory[i] represents the number of balls of the ith color that you initially own. You are also given an integer orders, which represents the total number of balls that the customer wants. You can sell the balls in any order.\n\nReturn the maximum total value that you can attain after selling orders colored balls. As the answer may be too large, return it modulo 109 + 7.\n\n\n\nExample 1:\n\nInput: inventory = [2,5], orders = 4\nOutput: 14\nExplanation: Sell the 1st color 1 time (2) and the 2nd color 3 times (5 + 4 + 3).\nThe maximum total value is 2 + 5 + 4 + 3 = 14.\nExample 2:\n\nInput: inventory = [3,5], orders = 6\nOutput: 19\nExplanation: Sell the 1st color 2 times (3 + 2) and the 2nd color 4 times (5 + 4 + 3 + 2).\nThe maximum total value is 3 + 2 + 5 + 4 + 3 + 2 = 19.\nExample 3:\n\nInput: inventory = [2,8,4,10,6], orders = 20\nOutput: 110\nExample 4:\n\nInput: inventory = [1000000000], orders = 1000000000\nOutput: 21\nExplanation: Sell the 1st color 1000000000 times for a total value of 500000000500000000. 500000000500000000 modulo 109 + 7 = 21.\n\n\nConstraints:\n\n1 <= inventory.length <= 105\n1 <= inventory[i] <= 109\n1 <= orders <= min(sum(inventory[i]), 109) =#","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"function max_profit(inventory::Vector{Int}, orders::Int)\n    rest = sum(inventory) - orders\n    sort!(inventory)\n    len = length(inventory)\n    for n in inventory\n        if rest ÷ len >= n\n            len -= 1\n            rest -= n\n        else\n            break\n        end\n    end\n    q = rest ÷ len\n    r = rest - q * len\n    ret = 0\n    for i in (length(inventory) - len + 1):length(inventory)\n        ret += sum((q + 2):inventory[i])\n    end\n    ret += (q + 1) * (len - r)\n    return ret % (10^9 + 7)\nend","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"","category":"page"},{"location":"democards/problems/id/1648.sell-diminishing-valued-colored-balls/","page":"1648.sell diminishing valued colored balls","title":"1648.sell diminishing valued colored balls","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/1297.maximum-number-of-occurrences-of-a-substring/#.maximum-number-of-occurrences-of-a-substring","page":"1297.maximum number of occurrences of a substring","title":"1297.maximum number of occurrences of a substring","text":"","category":"section"},{"location":"democards/problems/id/1297.maximum-number-of-occurrences-of-a-substring/","page":"1297.maximum number of occurrences of a substring","title":"1297.maximum number of occurrences of a substring","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/1297.maximum-number-of-occurrences-of-a-substring/","page":"1297.maximum number of occurrences of a substring","title":"1297.maximum number of occurrences of a substring","text":"\"\"\"\n@lc app=leetcode id=1297 lang=python3\n\n[1297] Maximum Number of Occurrences of a Substring\n\nhttps://leetcode.com/problems/maximum-number-of-occurrences-of-a-substring/description/\n\nalgorithms\nMedium (44.11%)\nLikes:    198\nDislikes: 145\nTotal Accepted:    11.8K\nTotal Submissions: 24.7K\nTestcase Example:  '\"aababcaab\"\\n2\\n3\\n4'\n\nGiven a string s, return the maximum number of ocurrences of any substring\nunder the following rules:\n\n\nThe number of unique characters in the substring must be less than or equal\nto maxLetters.\nThe substring size must be between minSize and maxSize inclusive.\n\n\n\nExample 1:\n\n\nInput: s = \"aababcaab\", maxLetters = 2, minSize = 3, maxSize = 4\nOutput: 2\nExplanation: Substring \"aab\" has 2 ocurrences in the original string.\nIt satisfies the conditions, 2 unique letters and size 3 (between minSize and\nmaxSize).\n\n\nExample 2:\n\n\nInput: s = \"aaaa\", maxLetters = 1, minSize = 3, maxSize = 3\nOutput: 2\nExplanation: Substring \"aaa\" occur 2 times in the string. It can overlap.\n\n\nExample 3:\n\n\nInput: s = \"aabcabcab\", maxLetters = 2, minSize = 2, maxSize = 3\nOutput: 3\n\n\nExample 4:\n\n\nInput: s = \"abcde\", maxLetters = 2, minSize = 3, maxSize = 3\nOutput: 0\n\n\n\nConstraints:\n\n\n1 <= s.length <= 10^5\n1 <= maxLetters <= 26\n1 <= minSize <= maxSize <= min(26, s.length)\ns only contains lowercase English letters.\n\n\n\n@lc code=start\n\"\"\"\nfunction max_freq(s::String, max_letters::Int, min_size::Int, max_size::Int)::Int\n    counts = Dict{SubString,Int}()\n    if max_size < min_size\n        0\n    else\n        for i in 1:(length(s) - min_size + 1)\n            for j in (i + min_size - 1):min(length(s), i + max_size + 1)\n                ŝ = SubString(s, i, j)\n                if length(Set(ŝ)) <= max_letters\n                    counts[ŝ] = get(counts, ŝ, 0) + 1\n                end\n            end\n        end\n    end\n    return length(counts) > 0 ? maximum(values(counts)) : 0\nend","category":"page"},{"location":"democards/problems/id/1297.maximum-number-of-occurrences-of-a-substring/","page":"1297.maximum number of occurrences of a substring","title":"1297.maximum number of occurrences of a substring","text":"","category":"page"},{"location":"democards/problems/id/1297.maximum-number-of-occurrences-of-a-substring/","page":"1297.maximum number of occurrences of a substring","title":"1297.maximum number of occurrences of a substring","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/88.merge-sorted-array/#.merge-sorted-array","page":"88.merge sorted array","title":"88.merge sorted array","text":"","category":"section"},{"location":"democards/problems/id/88.merge-sorted-array/","page":"88.merge sorted array","title":"88.merge sorted array","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/88.merge-sorted-array/","page":"88.merge sorted array","title":"88.merge sorted array","text":"\"\"\"\n@lc app=leetcode id=88 lang=python3\n\n[88] Merge Sorted Array\n\nhttps://leetcode.com/problems/merge-sorted-array/description/\n\nalgorithms\nEasy (37.77%)\nLikes:    2885\nDislikes: 4635\nTotal Accepted:    713K\nTotal Submissions: 1.8M\nTestcase Example:  '[1,2,3,0,0,0]\\n3\\n[2,5,6]\\n3'\n\nGiven two sorted integer arrays nums1 and nums2, merge nums2 into nums1 as\none sorted array.\n\nNote:\n\n\nThe number of elements initialized in nums1 and nums2 are m and n\nrespectively.\nYou may assume that nums1 has enough space (size that is equal to m + n) to\nhold additional elements from nums2.\n\n\nExample:\n\n\nInput:\nnums1 = [1,2,3,0,0,0], m = 3\nnums2 = [2,5,6],       n = 3\n\nOutput: [1,2,2,3,5,6]\n\n\n\nConstraints:\n\n\n-10^9 <= nums1[i], nums2[i] <= 10^9\nnums1.length == m + n\nnums2.length == n\n\n\n\n\n@lc code=start\n\"\"\"\nfunction merge_sorted_array(\n    nums1::AbstractVector{Int}, m::Int, nums2::AbstractVector{Int}, n::Int\n)::Nothing\n    i = m + n\n    while m > 0 && n > 0\n        if nums1[m] > nums2[n]\n            nums1[i] = nums1[m]\n            m -= 1\n        else\n            nums1[i] = nums2[n]\n            n -= 1\n        end\n        i -= 1\n    end\n\n    while n > 0\n        nums1[i] = nums2[n]\n        n -= 1\n    end\n\n    return nothing\nend","category":"page"},{"location":"democards/problems/id/88.merge-sorted-array/","page":"88.merge sorted array","title":"88.merge sorted array","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/88.merge-sorted-array/","page":"88.merge sorted array","title":"88.merge sorted array","text":"","category":"page"},{"location":"democards/problems/id/88.merge-sorted-array/","page":"88.merge sorted array","title":"88.merge sorted array","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/999.available-captures-for-rook/#.available-captures-for-rook","page":"999.available captures for rook","title":"999.available captures for rook","text":"","category":"section"},{"location":"democards/problems/id/999.available-captures-for-rook/","page":"999.available captures for rook","title":"999.available captures for rook","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/999.available-captures-for-rook/","page":"999.available captures for rook","title":"999.available captures for rook","text":"\"\"\"\n@lc app=leetcode id=999 lang=python3\n\n[999] Available Captures for Rook\n\nhttps://leetcode.com/problems/available-captures-for-rook/description/\n\nalgorithms\nEasy (65.89%)\nLikes:    256\nDislikes: 443\nTotal Accepted:    33.4K\nTotal Submissions: 50K\nTestcase Example:  '[[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"R\",\".\",\".\",\".\",\"p\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"]]'\n\nOn an 8 x 8 chessboard, there is one white rook.  There also may be empty\nsquares, white bishops, and black pawns.  These are given as characters 'R',\n'.', 'B', and 'p' respectively. Uppercase characters represent white pieces,\nand lowercase characters represent black pieces.\n\nThe rook moves as in the rules of Chess: it chooses one of four cardinal\ndirections (north, east, west, and south), then moves in that direction until\nit chooses to stop, reaches the edge of the board, or captures an opposite\ncolored pawn by moving to the same square it occupies.  Also, rooks cannot\nmove into the same square as other friendly bishops.\n\nReturn the number of pawns the rook can capture in one move.\n\n\n\nExample 1:\n\n\n\n\nInput:\n[[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"R\",\".\",\".\",\".\",\"p\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"]]\nOutput: 3\nExplanation:\nIn this example the rook is able to capture all the pawns.\n\n\nExample 2:\n\n\n\n\nInput:\n[[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\"p\",\"p\",\"p\",\"p\",\"p\",\".\",\".\"],[\".\",\"p\",\"p\",\"B\",\"p\",\"p\",\".\",\".\"],[\".\",\"p\",\"B\",\"R\",\"B\",\"p\",\".\",\".\"],[\".\",\"p\",\"p\",\"B\",\"p\",\"p\",\".\",\".\"],[\".\",\"p\",\"p\",\"p\",\"p\",\"p\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"]]\nOutput: 0\nExplanation:\nBishops are blocking the rook to capture any pawn.\n\n\nExample 3:\n\n\n\n\nInput:\n[[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\"p\",\"p\",\".\",\"R\",\".\",\"p\",\"B\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"B\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\"p\",\".\",\".\",\".\",\".\"],[\".\",\".\",\".\",\".\",\".\",\".\",\".\",\".\"]]\nOutput: 3\nExplanation:\nThe rook can capture the pawns at positions b5, d6 and f5.\n\n\n\n\nNote:\n\n\nboard.length == board[i].length == 8\nboard[i][j] is either 'R', '.', 'B', or 'p'\nThere is exactly one cell with board[i][j] == 'R'\n\n\n\n\n@lc code=start\n\"\"\"\nfunction num_rook_captures(board::Matrix{Char})::Int\n    res = 0\n    i, j = findfirst(==('R'), board).I\n\n    for v in (\n        @view(board[i, (j + 1):end]),  # right\n        @view(board[i, (j - 1):-1:1]),    # left\n        @view(board[(i - 1):-1:1, j]),    # up\n        @view(board[(i + 1):end, j]),  # down\n    )\n        x_ind = findfirst(!=('.'), v)\n        if !isnothing(x_ind) && v[x_ind] == 'p'\n            res += 1\n        end\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/999.available-captures-for-rook/","page":"999.available captures for rook","title":"999.available captures for rook","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/999.available-captures-for-rook/","page":"999.available captures for rook","title":"999.available captures for rook","text":"","category":"page"},{"location":"democards/problems/id/999.available-captures-for-rook/","page":"999.available captures for rook","title":"999.available captures for rook","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/164.maximum-gap/#.maximum-gap","page":"164.maximum gap","title":"164.maximum gap","text":"","category":"section"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"@lc app=leetcode id=164 lang=python3","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"[164] Maximum Gap","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"\"\"\"\nGiven an unsorted array, find the maximum difference between the successive elements in its sorted form.\n\nReturn 0 if the array contains less than 2 elements.\n\nExample 1:\n\nInput: [3,6,9,1]\nOutput: 3\nExplanation: The sorted form of the array is [1,3,6,9], either\n             (3,6) or (6,9) has the maximum difference 3.\nExample 2:\n\nInput: [10]\nOutput: 0\nExplanation: The array contains less than 2 elements, therefore return 0.\nNote:\n\nYou may assume all elements in the array are non-negative integers and fit in the 32-bit signed integer range.\nTry to solve it in linear time/space.\n\"\"\"","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"function maximum_gap(nums::Vector{Int})::Int\n    sort!(nums)\n    return length(nums) < 2 ? 0 : maximum(@view(nums[2:end]) - @view(nums[1:(end - 1)]))\nend","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"","category":"page"},{"location":"democards/problems/id/164.maximum-gap/","page":"164.maximum gap","title":"164.maximum gap","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/#.longest-substring-without-repeating-characters","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"","category":"section"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"\"\"\"","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"[3] Longest Substring Without Repeating Characters","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"https://leetcode.com/problems/longest-substring-without-repeating-characters/description/\n\n- algorithms\n- Medium (29.39%)\n- Likes:    7482\n- Dislikes: 440\n- Total Accepted:    1.3M\n- Total Submissions: 4.3M\n- Testcase Example:  '\"abcabcbb\"'\n\nGiven a string, find the length of the longest substring without repeating\ncharacters.\n\n\n# Example 1:\n\n\nInput: \"abcabcbb\"\nOutput: 3\nExplanation: The answer is \"abc\", with the length of 3.\n\n\n\n# Example 2:\n\n\nInput: \"bbbbb\"\nOutput: 1\nExplanation: The answer is \"b\", with the length of 1.\n\n\n\n# Example 3:\n\n\nInput: \"pwwkew\"\nOutput: 3\nExplanation: The answer is \"wke\", with the length of 3.\n⁠            Note that the answer must be a substring, \"pwke\" is a\nsubsequence and not a substring.\n\"\"\"\nfunction length_of_longest_substring(s::String)::Int\n    seen = Set{Char}()\n    res = 0\n\n    for x in s\n        if x in seen\n            empty!(seen)\n        end\n        push!(seen, x)\n        res = max(res, length(seen))\n    end\n    return res\nend","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"","category":"page"},{"location":"democards/problems/id/3.longest-substring-without-repeating-characters/","page":"3.longest substring without repeating characters","title":"3.longest substring without repeating characters","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/127.word-ladder/#.word-ladder","page":"127.word ladder","title":"127.word ladder","text":"","category":"section"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"@lc app=leetcode id=127 lang=julia","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"[127] Word Ladder","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"#=\nGiven two words (begin_word and end_word), and a dictionary's word list, find the length of shortest transformation sequence from begin_word to end_word, such that:\n\nOnly one letter can be changed at a time.\nEach transformed word must exist in the word list.\nNote:\n\nReturn 0 if there is no such transformation sequence.\nAll words have the same length.\nAll words contain only lowercase alphabetic characters.\nYou may assume no duplicates in the word list.\nYou may assume begin_word and end_word are non-empty and are not the same.\nExample 1:\n\nInput:\nbegin_word = \"hit\",\nend_word = \"cog\",\nword_list = [\"hot\",\"dot\",\"dog\",\"lot\",\"log\",\"cog\"]\n\nOutput: 5\n\nExplanation: As one shortest transformation is \"hit\" -> \"hot\" -> \"dot\" -> \"dog\" -> \"cog\",\nreturn its length 5.\nExample 2:\n\nInput:\nbegin_word = \"hit\"\nend_word = \"cog\"\nword_list = [\"hot\",\"dot\",\"dog\",\"lot\",\"log\"]\n\nOutput: 0\n\nExplanation: The end_word \"cog\" is not in word_list, therefore no possible transformation. =#","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"import Pkg Pkg.add(\"DataStructures\")","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"using DataStructures","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"function ladder_length(begin_word::String, end_word::String, word_list::Vector{String})::Int\n    function isadj(s1, s2)\n        flg = false\n        for i in 1:length(s1)\n            if s1[i] != s2[i]\n                if flg\n                    return false\n                else\n                    flg = true\n                end\n            end\n        end\n        return true\n    end\n    if !(end_word in word_list)\n        return 0\n    end\n    !(begin_word in word_list) && push!(word_list, begin_word)\n    s, t = findall(x -> x == begin_word, word_list)[1],\n    findall(x -> x == end_word, word_list)[1]","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"println(s, \", \", t) wl = collect.(word_list)","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"    len = length(word_list)\n    edges = [Set{Int}() for i in 1:len]\n    # construct adj list\n    for i in 1:len\n        for j in (i + 1):len\n            if isadj(word_list[i], word_list[j])\n                push!(edges[i], j)\n                push!(edges[j], i)\n            end\n        end\n    end\n    # BFS\n    qs, qt = Queue{Int}(), Queue{Int}()\n    dists = [0 for i in 1:len]\n    visited = [0 for i in 1:len]\n    enqueue!(qs, s)\n    enqueue!(qt, t)\n    visited[s] = 1\n    visited[t] = 2\n    dists[s] = dists[t] = 1\n    while !isempty(qs) && !isempty(qt)\n        rt1, rt2 = dequeue!(qs), dequeue!(qt)\n        dis1, dis2 = dists[rt1] + 1, dists[rt2] + 1","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"println(rt1, \" \", dis1)","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"        for neib in edges[rt1]\n            if visited[neib] == 2\n                return dis1 + dists[neib] - 1\n            elseif visited[neib] == 0\n                visited[neib] = 1\n                enqueue!(qs, neib)\n                dists[neib] = dis1\n            end\n        end\n        for neib in edges[rt2]\n            if visited[neib] == 1\n                return dis2 + dists[neib] - 1\n            elseif visited[neib] == 0\n                visited[neib] = 2\n                enqueue!(qt, neib)\n                dists[neib] = dis2\n            end\n        end\n    end\n    return 0\nend","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"","category":"page"},{"location":"democards/problems/id/127.word-ladder/","page":"127.word ladder","title":"127.word ladder","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/#.remove-k-digits","page":"402.remove k digits","title":"402.remove k digits","text":"","category":"section"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"@lc app=leetcode id=402 lang=julia","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"[402] Remove K Digits","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"\"\"\"\nGiven a non-negative integer num represented as a string, remove k digits from the number so that the new number is the smallest possible.\n\nNote:\nThe length of num is less than 10002 and will be ≥ k.\nThe given num does not contain any leading zero.\nExample 1:\n\nInput: num = \"1432219\", k = 3\nOutput: \"1219\"\nExplanation: Remove the three digits 4, 3, and 2 to form the new number 1219 which is the smallest.\nExample 2:\n\nInput: num = \"10200\", k = 1\nOutput: \"200\"\nExplanation: Remove the leading 1 and the number is 200. Note that the output must not contain leading zeroes.\nExample 3:\n\nInput: num = \"10\", k = 2\nOutput: \"0\"\nExplanation: Remove all the digits from the number and it is left with nothing which is 0.\n\"\"\"","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"@lc code=start","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"function remove_kdigits(num::String, k::Int)::String\n    num_code = codeunits(num)\n    stk = UInt8[]\n    for ch in num_code\n        if k == 0 || isempty(stk)\n            push!(stk, ch)\n        else\n            while !isempty(stk) && stk[end] > ch && k > 0\n                pop!(stk)\n                k -= 1\n            end\n            push!(stk, ch)\n        end\n    end\n    idx = findfirst(x -> x != UInt8('0'), stk)\n    if idx === nothing\n        return \"0\"\n    end\n    return String(@view stk[idx:(end - k)])\nend","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"","category":"page"},{"location":"democards/problems/id/402.remove-k-digits/","page":"402.remove k digits","title":"402.remove k digits","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"},{"location":"democards/problems/id/872.leaf-similar-trees/#.leaf-similar-trees","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"","category":"section"},{"location":"democards/problems/id/872.leaf-similar-trees/","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"(Image: Source code) (Image: notebook)","category":"page"},{"location":"democards/problems/id/872.leaf-similar-trees/","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"\"\"\"\n@lc app=leetcode id=872 lang=python3\n\n[872] Leaf-Similar Trees\n\nhttps://leetcode.com/problems/leaf-similar-trees/description/\n\nalgorithms\nEasy (64.60%)\nLikes:    933\nDislikes: 44\nTotal Accepted:    104.4K\nTotal Submissions: 161.9K\nTestcase Example:  '[3,5,1,6,2,9,8,null,null,7,4]\\n' +\n'[3,5,1,6,7,4,2,null,null,null,null,null,null,9,8]'\n\nConsider all the leaves of a binary tree, from left to right order, the\nvalues of those leaves form a leaf value sequence.\n\n\n\nFor example, in the given tree above, the leaf value sequence is (6, 7, 4, 9,\n8).\n\nTwo binary trees are considered leaf-similar if their leaf value sequence is\nthe same.\n\nReturn true if and only if the two given trees with head nodes root1 and\nroot2 are leaf-similar.\n\n\nExample 1:\n\n\nInput: root1 = [3,5,1,6,2,9,8,null,null,7,4], root2 =\n[3,5,1,6,7,4,2,null,null,null,null,null,null,9,8]\nOutput: true\n\n\nExample 2:\n\n\nInput: root1 = [1], root2 = [1]\nOutput: true\n\n\nExample 3:\n\n\nInput: root1 = [1], root2 = [2]\nOutput: false\n\n\nExample 4:\n\n\nInput: root1 = [1,2], root2 = [2,2]\nOutput: true\n\n\nExample 5:\n\n\nInput: root1 = [1,2,3], root2 = [1,3,2]\nOutput: false\n\n\n\nConstraints:\n\n\nThe number of nodes in each tree will be in the range [1, 200].\nBoth of the given trees will have values in the range [0, 200].\n\n\n\n\n@lc code=start\n\"\"\"\nfunction leaf_similar(root1::TreeNode{V}, root2::TreeNode{V})::Bool where {V}\n    leaves1 = V[]\n    leaves2 = V[]\n    find_leaves!(root1, leaves1)\n    find_leaves!(root2, leaves2)\n    return leaves1 == leaves2\nend\n\nfunction find_leaves!(t::TreeNode, leaves)\n    if isnothing(t.left) && isnothing(t.right)\n        push!(leaves, t.val)\n    else\n        find_leaves!(t.left, leaves)\n        find_leaves!(t.right, leaves)\n    end\nend\n\nfind_leaves!(::Nothing, leaves) = nothing","category":"page"},{"location":"democards/problems/id/872.leaf-similar-trees/","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"@lc code=end","category":"page"},{"location":"democards/problems/id/872.leaf-similar-trees/","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"","category":"page"},{"location":"democards/problems/id/872.leaf-similar-trees/","page":"872.leaf similar trees","title":"872.leaf similar trees","text":"This page was generated using DemoCards.jl and Literate.jl.","category":"page"}]
